INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`)
VALUES
	(73,2,'Боди','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','Боди','',''),
	(74,2,'Носки','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','Носки','',''),
	(99,2,'Girl','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Праздничная коллекция &lt;/span&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Elsy&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; &lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Girl&lt;/span&gt;&lt;/b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;в пестрых оттенках для девочек.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Весна пришла, пришло время готовиться к торжествам,\r\nкоторыми будет богат этот сезон. Заразительная страсть к легкости пронизывает\r\nколлекцию одежды для девочек, предназначенной для торжественных церемоний, и\r\nпозволяет нам погрузиться в атмосферу настоящего лета с его яркими цветовыми\r\nградациями оттенков неба и моря.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Полоски и матросские мотивы с нотками искристости и\r\nестественности заново интерпретируют «морской» стиль. Платье в полоску в водных\r\nтонах кажется сказочно-акварельным, оттенки морских глубин отливают на широких,\r\nструящихся формах с особой элегантностью. Благодаря мелким деталям и фурнитуре,\r\nизделия коллекции станут must-have сезона: топ с воланами, напоминающими\r\nморские волны, обнажает плечи, а широкие брюки следуют строгому матросскому\r\nстилю.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height:1.295;margin-top:0pt;margin-bottom:8pt;&quot;&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Гармоничное слияние гламурного стиля, живых играющих\r\nкрасок и классики в тонах придают образу баланс: от сдержанности до роскошного\r\nблеска.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','Одежда для девушек Elsy Girl в Украине | Little-House','Elsy Girl | Оригинальная одежда для девушек в Украине. Высокое качество. ',''),
	(147,2,'Horses Dreams','&lt;p&gt;Horses Dreams серия о лошадях, включающая множество ярких и неординарных альбомов и аксессуаров для творчества для мальчиков и девочек возрастом от 4 лет. Horses Dreams — это красочные альбомы, школьные принадлежности, а также подарочные изделия для детей, которые увлекаются лошадьми.&lt;/p&gt;','Подарочная продукция Top Model - Horses Dreams в Украине | Little-House','Top Model | Оригинальная подарочная продукция серии Horses Dreams в Украине. ',''),
	(148,2,'Miss Melody','&lt;p&gt;Miss Melody – это история о лошадях и девочках, а также их приключениях в школе верховой езды. Коллекция Miss Melody представлена в определенных цветовых решениях, с подходящим тон-в- тон дизайном и состоит из разнообразных потрясающих сувениров.&lt;/p&gt;','Подарочная продукция Top Model - Miss Melody в Украине | Little-House',' Top Model | Оригинальная подарочная продукция серии Miss Melody в Украине. ',''),
	(149,2,'Ylvi and Minimoomis','&lt;p&gt;В фантастичном мире живет магическая фея Илви со своими лучшими друзьями Наей, прирученным единорогом и симпатичными сказочными существами Минимумис. В коллекции основное внимание уделяется милым плюшевым Минимумис с очень большими, доверчивыми глазами и большим сердцем.&lt;/p&gt;','Подарочная продукция Top Model - Ylvi And Minimoomis в Украине | Little-House','Top Model | Оригинальная подарочная продукция серии Ylvi And Minimoomis в Украине. ',''),
