	(144,2,'My Style Princess','&lt;p&gt;Все герои и продукция разработаны специально для младшей аудитории и представляют собой мечту любой маленькой девочки быть принцессой. В центре внимания— принцесса Мими, ее многообразный гардероб платьев и украшений, а также ее лучшая подруга Лисси, и кролики Нелли и Элла.&lt;/p&gt;','Подарочная продукция Top Model - My Style Princess в Украине | Little-House',' Top Model | Оригинальная подарочная продукция серии My Style Princess в Украине. ',''),
