	(145,2,'Creative Studio','&lt;p&gt;Альбомы для творчества с наклейками прекрасно подойдут для мальчиков и девочек от четырех лет. С их помощью дети смогут &quot;построить&quot; город, &quot;посетить&quot; зоопарк, познакомиться с фермой и её обитателями, &quot;создать&quot; свой замок и многое другое.&lt;/p&gt;','Альбомы для творчества Top Model в Украине | Little-House',' Top Model | Оригинальные альбомы для творчества в Украине. ',''),
	(146,2,'Monster Cars','&lt;p&gt;Линейка рассчитана на мальчиков от пяти лет. С Monster Cars мальчики смогут создавать неповторимые спортивные автомобили. &lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Яркие, красочные альбомы для создания неповторимого дизайна спортивных машин, карандаши и фломастеры, пеналы, все, чтобы порадовать мальчишек!&lt;/p&gt;','Подарочная продукция Top Model - Monster Cars в Украине | Little-House','Top Model | Оригинальная подарочная продукция серии Monster Cars в Украине. ',''),
	(65,2,'Top Model','&lt;p dir=&quot;ltr&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Depesche&lt;/span&gt; – дистрибьютор трендовой подарочной продукции для детей и подростков.&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;Компания основана в 1985 году в Гамбурге, Германия, и насчитывает на сегодняшний день около 320 человек. Depesche является одним из ведущих Европейских поставщиков подарочной продукции. Качество Depesche одобрено TÜV (Technische Überwachungs-Verein), лидером в области экспертизы, испытаний и сертификации. При этом все этапы производства выполняются непосредственно компанией производителем, от концепции до разработки продукта, включая контроль за производством и контроль качества. Маркировка &lt;span style=&quot;font-weight: bold;&quot;&gt;CE&lt;/span&gt; указывает на то, что изделие не является вредным для здоровья его потребителей, а также безвредно для окружающей среды. Бескомпромиссно наилучшее качество – кредо Depesche.&lt;br&gt;&lt;/p&gt;','Top Model','',''),
	(81,2,'Men','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(90, 89, 89); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;HANRO Man&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(90, 89, 89); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;В эру digital особо ценится личная свобода и\r\nмоменты полного спокойствия. Стремление к непринужденности выражается в выборе\r\nбелья и одежды способной подчеркнуть индивидуальность и одновременно приятной к\r\nтелу.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: rgb(90, 89, 89); font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;Для всех любящих хлопок джентльменов Hanro\r\nиспользуют настоящий «Sea Island» - просто лучший хлопок в мире. Даже Джеймс\r\nБонд любил носить одежду из Sea Island и, если он достаточно хорош для Джеймса\r\nБонда, это, безусловно, достаточно и для нас.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(90, 89, 89); font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(90, 89, 89); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Особое внимание компания уделяет комфорту\r\nклиентов. Учитывая их пожелания, совершенствует модели и ткани. В основе\r\nцветовой палитры лежат приглушенные тона, а оттенки синего и зеленого служат\r\nакцентами. Вещи марки на две третьих изготовлены из натуральных материалов:\r\nшелк, хлопок и кашемир обретают новый смысл с помощью современных технологий.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(90, 89, 89); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;o:p&gt;&lt;br&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(90, 89, 89); font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;В своих коллекциях бренд использует бесшовную\r\nобработку, мягкую мерсеризацию и швейцарскую вышивку. SS 2018 несет в себе\r\nлегкость, непринужденность, а также нестареющую классику и ДНК бренда.\r\nПриглушенные цвета гармонично смотрятся с новыми яркими весенними оттенками\r\nзолотисто-желтого и динамичными принтами. В линейку вошли удобные гармонирующие\r\nс современностью модели: рубашки, домашние штаны и блейзеры – универсальные\r\nфавориты на каждый день.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: rgb(90, 89, 89); font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;Сильный пол оценит комфорт и качество\r\nматериалов в пижамах и халатах бренда в монохромном стиле, а боксеры из 100%\r\nтканого хлопка можно носить не только как нижнее белье днем, но и заменить\r\nлюбимую пижаму ночью.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;color: rgb(90, 89, 89); font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(90, 89, 89); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Независимо от того, где вы окажетесь, дома или\r\nза сотни километров, облачившись в одежду HANRO, вы всегда ощутите комфорт и\r\nумиротворение.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(90, 89, 89); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;','Мужское белье Hanro | Little-House','Hanro| Оригинальное мужское белье. Высокое качество. ',''),
	(63,2,'Sanetta','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Sanetta&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; – немецкий производитель элегантного\r\nдетского белья и пижам, халатов и одежды для спорта и дома от рождения до 16\r\nлет.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Семейный бизнес с 1956 года, в третьем поколении бренд\r\n&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Sanetta&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; очень требователен к вопросам качества, органичности и стиля.\r\nОтличительные преимущества бренда понятны и близкие каждому.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;СДЕЛАНО В ЕВРОПЕ&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Продукция производится на собственных фабриках в\r\nЕвропе. Близость к производству гарантирует соблюдение высоких стандартов\r\nкачества.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;МЕДИЦИНСКИ ТЕСТИРОВАНО&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Как инициатор и соучредитель нескольких медицинских\r\nстандартов, &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Sanetta&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; с гордостью воплотила их в собственную производственную линию. С помощью\r\nкомплексного и трудоемкого процесса все материалы проходят испытание на\r\nпереносимость кожей на основе симуляции кожных клеток.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;БЕСШОВНОСТЬ&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Нет скрученным, раздражающим и колючим швам. Особая\r\nтехнология кругового плетения позволяет ребенку чувствовать себя комфортно и\r\nбезопасно.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;ОТЖИМ&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Sanetta&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; разработала специальную технологию, которая повышает устойчивость волокон\r\nк деформации во время отжима. Технология не предполагает использование химических\r\nматериалов, только воду, пар и высокую температуру. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;НАТУРАЛЬНЫЙ ХЛОПОК&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Наш натуральный хлопок проходит контроль качества &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;GOTs&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; (Глобальный органический текстильный\r\nстандарт, см. больше на &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;www&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;.&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;globalstandard&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;.&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;org&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;). Это означает, что он не содержит инсектицидов и пестицидов, и безопасен\r\nне только для людей, но и окружающей среды.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;ЗАЩИТА ОТ\r\nУЛЬТРАФИОЛЕТА&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;С целью защитить детскую чувствительную кожу от\r\nопасных солнечных лучей &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Sanetta&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; предлагает фактор защиты от 15+ до 50+.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;2 ГОДА ГАРАНТИИ&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Одежда &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Sanetta&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; не дает усадку, не теряет цвет и не рвется, при условии соблюдения\r\nрекомендации по уходу. Именно поэтому &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Sanetta&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; дает 2 года гарантии на материалы, отделку и\r\nфурнитуру.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;ОЕКО - ТЕХ СТАНДАРТ 100&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Если предмет одежды получил награду ОЕКО - ТЕХ\r\nстандарт 100, ни одна деталь, будь то пряжа, краски или пуговицы, не\r\nпредставляют никакой опасности для здоровья. &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Просто идеально для вашего ребенка.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','Детская одежда Sanetta в Украине | Little-House','Sanetta | Оригинальная детская одежда в Украине. Высокое качество. ',''),
	(153,2,'Fantasy Model','&lt;p&gt;Линия для девочек от 8 лет и подростков из фантазийного мира эльфов, русалок и принцесс. Таинственный и завораживающий мир сказок, историй и легенд оживает в блестящей аксессуарной продукции, украшенной сказочными рисунками и образами магических героев.&lt;/p&gt;','Подарочная продукция Top Model - Fantasy Model в Украине | Little-House','Top Model | Оригинальная подарочная продукция серии  Fantasy Model в Украине. ',''),
	(94,2,'Игрушки','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Линейка плюшевых игрушек &lt;b&gt;Steiff.&lt;/b&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Мировая история мишки Тедди трогательна и берет начало\r\nконечно же в компании Steiff. Медведи Тедди и другие плюшевые игрушки\r\nпроизводства Steiff имеют колоссальный успех, являясь лидерами продаж в\r\nиндустрии игрушек и подарков. А коллекционные игрушки Steiff&amp;nbsp; - редки, уникальны и роскошны в каждой\r\nдетали, как предметы раритета.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;1902 год стал годом рождения всемирно известного мишки\r\nТедди, мишки, который мог обнять ребенка своими мохнатыми лапками и всюду\r\nсопровождать его. С 1904 года в компанию пришел всемирный успех, именно тогда\r\nбыл сделан первый заказ в 3000 мишек от американского бизнесмена, и уже к концу\r\nгода Мануфактура выпустила 12 000 мишек! С именем мишки Тедди связано имя 26-го\r\nпрезидента США Теодора Рузвельта, который пощадил на охоте американского\r\nчерного медведя и затем получил ласковое имя “Тедди”.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;В создании игрушек Steiff дизайнеры работают с живыми\r\nживотным, чтобы внешний вид и движения зверушек были максимально реалистичны.\r\nКачество и красота изделий являются результатом многих месяцев создания и\r\nручной работы. В производстве игрушек Steiff использует в основном натуральные\r\nматериалы изысканного качества, такие как мохер, альпака или тканый плюш.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height:1.295;margin-top:0pt;margin-bottom:8pt;&quot;&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Новая коллекция плюшевых зверей - Soft Cuddly Friends\r\nсоздана специально для обьятий и не оставит равнодушными ни детей,\r\nни взрослых. Ультрамягкий плюш, современный дизайн и непревзойдённое качество\r\nвыделят игрушки бренда среди других.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;br&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;br&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','Игрушки и одежда Steiff в Украине | Little-House','Steiff| Оригинальные игрушки и одежда в Украине. Высокое качество. ',''),
	(77,2,'Перчатки','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Перчатка от &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Roeckl&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt; &lt;/span&gt;– объяснение в любви нашей руке.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Ни один предмет нашего гардероба не является таким\r\nфункциональным и одновременно таким сложным в изготовлении, как перчатка.\r\nПоэтому любая пара перчаток от &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Roeckl&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; является уникальной.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Начало всему – кожа. Но не всякая кожа. Обработке\r\nподвергается исключительно тонкая и качественная кожа. На кожевенном складе &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Roeckl&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; можно увидеть разнообразные виды этого\r\nдрагоценного природного материала: нежную кожу пекари и овечью кожу,\r\nбезупречную кожу оленя и теплые шкуры ягненка, а также редкие виды кожи д ля\r\nспециальной обработки.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Важнейшие технологии изготовления перчаток были\r\nразработаны во Франции в &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;VIII&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; столетии. Эти технологии &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Roeckl&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; использует и по сей день для того, чтобы перчатка облегала руку как вторая\r\nкожа. Сначала кусок кожи фиксируется, затем обрабатывается специальным ножом\r\nдля достижения однородной толщины. Следующий за этим ручной раскрой требует\r\nсноровки, приобретаемой в процессе длительного обучения: кожа вытягивается на\r\nспециальном столе в длину и в ширину, затем разрезается на заготовки, из\r\nкоторых впоследствии делается вырубка деталей нужного размера. Вытягивание кожи\r\nобеспечивает оптимальную п осадку готового изделия.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;При изготовлении отдельных моделей мастера соединяют\r\nмежду собой до 24-х деталей и, в зависимости от модели, прошивают вручную до 2\r\nтысяч и более стежков. Поэтому перчатка от &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Roeckl&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; сидит как вторая кожа, сохраняет\r\nчувствительность кончиков пальцев, обеспечивает свободу движений и оптимальную\r\nзащит у от холода и долго сохраняет свою красоту.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','Перчатки  Roeckl|Little-House','Roeckl| Оригинальные перчатки в ассортименте. Высокое качество. ',''),
	(84,2,'Women','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(90, 89, 89); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;На первом месте в HANRO всегда стояли интересы\r\nи пожелания клиентов, и только потом – производственная необходимость. Желания\r\nклиентов учитывались на каждом этапе создания белья, начиная с выбора\r\nматериалов, их текстуры, заканчивая фирменной упаковкой. Продукция компании\r\nHANRO на две трети создается из натуральных природных материалов: очищенный\r\nегипетский хлопок, редкий хлопок Карибских островов, австралийская шерсть, шелк,\r\nсмесь шелка и шерсти и другие.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(90, 89, 89); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot; style=&quot;margin-top: 0pt; margin-bottom: 10pt;&quot;&gt;\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(90, 89, 89); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Уникальное качество и несравнимые ни с чем\r\nощущения комфорта при носке изделий уже много десятилетий высоко ценятся\r\nклиентами во всем мире. Мэрилин Монро была в нижнем белье бренда в известной\r\nсцене фильма «Зуд седьмого дня», Дженифер Энистон в &quot;Марви и я&quot;,\r\nДакота Джонсон в нашумевшем «50 оттенков серого». Так, после сцены с Николь\r\nКидман в фильме «С широко закрытыми глазами» спагетти – топ HANRO обрел мировую\r\nпопулярность. С 1985 года он остается бестселлером бренда. Изготовлен из\r\nультралегкого, дышащего мерсеризованного хлопка с регулируемыми атласными\r\nбретелями, превращает топ в must have в гардеробе модниц.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot; style=&quot;line-height:1.3800000000000001;margin-top:0pt;margin-bottom:10pt;&quot;&gt;&lt;br&gt;&lt;/p&gt;','Женское белье Hanro | Little-House','Hanro| Оригинальное  женское белье. Высокое качество. ',''),
	(62,2,'Steiff','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;«Для ребенка достаточно только лучшего» - эта фраза\r\nосновательницы бренда Маргареты Штайфф стала девизом семейной компании, которая\r\nработает на мировом рынке с 1880 года. Как и полагается европейскому бренду, &lt;b&gt;Steiff &lt;/b&gt;обладает богатой историей и\r\nтрадициями, а также имеет свой кодекс высоких стандартов качества и социальной\r\nответственности и является изобретателем плюшевых игрушек и культовых медведей\r\nТедди, имеющих коллекционный статус и выпускающихся лимитированными сериями.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Кроме знаковых игрушек бренд выпускает коллекцию одежды,\r\nкак для новорожденных, так и для детей. Уже 16 лет существует линия детской\r\nодежды Steiff, которая включает в себя несколько линеек и коллекцию\r\nаксессуаров&amp;nbsp; в разнообразных цветах и\r\nфасонах от рождения до 6 лет. Дети в одежде Steiff — само очарование и\r\nнепосредственность.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;br&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;Один из самых известных рекордов Steiff: самая высокая\r\nцена аукциона € 213.720 была заплачена за мишку Тедди, одетого в Луи Вуиттон. Также\r\nбренд производит лицензированные игрушки для Ворнер Бразерс и Дисней, работает\r\nс Жан Полем Готье и Карлом Лагерфельдом, а также производит корпоративные\r\nигрушки.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;','Продукция Steiff в Украине | Little-House','Steiff| Оригинальная продукция  в Украине. Высокое качество. ',''),
	(87,2,'Одежда','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Высокий комфорт при ношении, тщательный подбор\r\nматериалов и функционально-ориентированный дизайн - это обязательства, которые\r\nсоответствуют многолетней философии &lt;b&gt;Steiff&lt;/b&gt;.\r\n&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Функциональная и классическая детская одежда для маленьких личностей\r\nпредставлена в 2-х линиях:&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;br&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-weight: bold; font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;New Born – для новорожденных и младенцев, размер 50 –\r\n86.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Коллекции для самых маленьких отличаются серьезным\r\nподходом к наполнению и качеству. Боди и комбинезоны-слип на каждый день из\r\nтончайшего и нежного хлопка. Костюмы и комплекты из хлопка и велюра для\r\nпрогулок и игр на свежем воздухе. Special Day – комбинезоны слип, платья, поло,\r\nтопы и леггинсы для праздничных моментов. Дизайн, гармоничный выбор цвета и\r\nлюбовно разработанные принты делают коллекцию Steiff привлекательной маркой для\r\nмаленьких&amp;nbsp; личностей.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;br&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-weight: bold; font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;Mini Boys, Mini Girls – для детей до 6 лет, размер 62 –\r\n128.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Для мальчиков и девочек в Steiff разработали\r\nудобные и практичные вещи для детского сада и песочницы (свитшоты, худи, джинсы\r\nи другие модели) а также линейку для особых праздничных моментов – платья,\r\nбрюки, топы и леггинсы. Коллекция для девочек исполнена преимущественно в белых\r\nоттенках, а также приглушенного серого меланжа. Коллекция для мальчиков –\r\nдополнена фирменным цветом синего от Steiff.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;В пошиве безрукавок и курток брендом используются\r\nветронепроницаемые и влагооталкивающие ткани. В купальных костюмах ткань имеет\r\nзащиту от ультрафиолета, что очень важно для безопасности на солнце.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;В весенне-летней коллекции бренда представлена\r\nцветовая палитра из мягких розовых, голубых и белых оттенков. Многие вещи из\r\nколлекции выполнены из тонкого трикотажа и хлопка. Этой весной Steiff предлагает\r\nразнообразие повседневных платьев, брюк и топов в паре с нарядными предметами\r\nдля особых случаев. Присутствует и классическая casual одежда - как пуховики,\r\nбезрукавки, пуловеры с характерной эмблемой мишки. Для летних моделей чаще\r\nвсего использован хлопок, а также его разновидности, типа денима.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;Пастельные цвета господствуют в сезоне SS2018.\r\nЗефирно-розовый, нежно-голубой, салатовый — такие оттенки прекрасно подходят\r\nдетскому гардеробу и создают весеннее настроение.&lt;/span&gt;&lt;/p&gt;','Одежда Steiff в Украине | Little-House','Steiff| Оригинальная в Украине. Высокое качество. ',''),
	(64,2,'Elsy','			&lt;p&gt;&lt;b&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Elsy&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; - изысканная и стильная одежда для юных леди.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Все коллекции строятся по принципу total look, а\r\nосновные образы созданы в истинном духе бренда: элегантны и не лишены комфорта,\r\nчто так важно для девочки подростка. Итальянский бренд искусно сочетает нежные\r\nоттенки и разные текстуры в тканях, а в практически безграничной коллекции\r\nплатьев и верхней одежде вы точно сможете найти любимое.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Бренд предлагает маленьким модницам 2 линии одежды и\r\nаксессуаров: &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Elsy Baby - для малышей от 1 до 7 лет. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Elsy Girl - линия для подростков от 7 до 16 лет. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;В сезонных коллекциях Elsy ярко выражены основные\r\nпреимущества бренда:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;- итальянская элегантность &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;- уникальный дизайн &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;- сочетание стильных в сезоне цветов и тканей &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;- безупречное качество изделий и комфорт&lt;/span&gt;&lt;/p&gt;','Детская одежда Elsy в Украине | Little-House','Elsy | Оригинальная детская одежда в Украине. Высокое качество. ',''),
	(100,2,'Baby','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Гармония, внимание к деталям – характерные особенности\r\nвесенне-летней коллекции линейки &lt;b&gt;Elsy\r\nBaby&lt;/b&gt;. Обновленные, но сохранившие свою особенность, кэжуал модели со\r\nсдержанными формами, комфортными объемами, выделят и подчеркнут красоту девочек\r\nдаже в самой неформальной обстановке.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Пастельные краски и светлая база в комплекте, брюки\r\nсвободного кроя, плюс светлые штрихи на изделиях с минималистскими линиями. В\r\nцентре внимания – футболки. Задумайтесь, как впечатляюще они превратились из спортивной\r\nодежды в дизайнерский геометрический наряд, благодаря вставкам макро-горошка из\r\nпайеток и принтам с забавными, ироническими картинками?&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;Для современных девочек самое главное выглядеть\r\nбесподобно на любом празднике. Elsy поможет создать праздничное настроение для\r\nвашей девочки. В безграничной коллекции платьев вы точно найдете подходящее Не\r\nважно, что вы выберете: белоснежное платье, в модном оттенке маршмеллоу ,\r\nкружевное или в насыщенном красном оттенке. В любом из них ваша юная леди будет\r\nчувствовать себя не только самой красивой принцессой, но и точно комфортно. &lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;И\r\nкак говорится, No Shine, No Party, в платье Elsy можно блистать на любом\r\nпразднике.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;','Одежда для девочек Elsy Baby в Украине | Little-House','Elsy Girl | Оригинальная одежда для девочек в Украине. Высокое качество. ',''),
	(151,2,'Top Model','&lt;p&gt;Линия продукции для гламурных девочек от 8 лет и подростков. Детально разработанный дизайн канцелярии, трендовой косметики для создания макияжев и причесок, дизайна маникюра, нарядов и украшений, а также школьных аксессуаров и принадлежностей представляют собой завораживающий, интерактивный мир ТОP Model.&lt;br&gt;&lt;/p&gt;','Продукция Top Model в Украине | Little-House','Top Model | Купить оригинальнцю продукцию в Украине. ',''),
	(68,2,'Kids','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;F&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;alke &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Kid’s &lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Лето для Falke Kids пройдет в стиле Калифорнийского\r\nпобережья. Красочные носки коллекции 2018 вдохновлены пляжами Малибу,\r\nроликовыми коньками, лимонадом, мороженным и солнцезащитными очками. Яркие\r\nноски в сочетании с мягкими пастельными тонами с летними неоновыми акцентами\r\nпрезентуют нам веселую и забавную сторону солнечного отпускного сезона. Так\r\nчто, feel Falke – feel summer.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Девочки&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Леггинсы с контрастными кружевными вставками и ярким\r\nлюрексом, а также ажурные носки с оборками – любимчики каждой девочки. Оттенки\r\nносочков напоминают сладкое мятное мороженое и прибавляют хорошего настроения\r\nвместе с их разнообразными узорами улыбающихся рожков. Полосатые носочки в\r\nвеселой версии «смешивай и совмещай», которые показывают маленькую мышку с\r\nлимонадом и мороженым на левой ножке и мышку в солнечных очках - на правой,\r\nобещают массу веселья.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Мальчики&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Куда же летом без солнцезащитных очков и стильных панам,\r\nкоторые присутствуют в коллекции аксессуаров для мальчиков. Неоновые цвета с\r\nконтрастными манжетами также привлекают взгляд, а носочки в морских цветах в\r\nсерфинговской тематике обещают охлаждающее действие в летние жаркие дни.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Деним &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Джинсовые стиль – это постоянный тренд, представленный\r\nи в коллекции &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Falke&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Kids&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;. Носочки с прикольными заплатками или спортивными полосками предлагаются\r\nдля мальчиков, а девочек ожидают розовые носочки с синими сердцами и\r\nженственными оборками. Трендовая тема заплаток также используется для носочков\r\nдля девочек: яркие заплатки на нежном розовом цвете прекрасно сочетаются со\r\nсвежими летними образами.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;br&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;Младенцы&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0px;&quot;&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Под девизом «Увидимся скоро. Пляж.», акцент в детских\r\nносочках и колготках сделан на морских животных и на пляже. На правой и левой\r\nножках расположились узнаваемые символы: морские звезды и раковины, песчаные\r\nзамки и огненно-красные крабы. Цветовая палитра варьируется от свежих морских\r\nтонов до&amp;nbsp; нежных и пастельных.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','Детские носки и одежда Falke |Little-House','Falke | носки детские в ассортименте. Высокое качество. И оригинальная продукция.',''),
	(66,2,'Men','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Falke Man&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Мужской ассортимент Falke отличается многообразием,\r\nуникальностью и функциональностью.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Элегантная бизнес-линейка, &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Luxury&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;коллекция, функциональные носки с\r\nзапатентованной анатомической посадкой под правую и левую ногу, стильные\r\nхлопковые и кашемировые кэжуал модели и трендовая фешн линейка – далеко не все,\r\nчто предлагает Falke мужчинам.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;В мужской коллекции &amp;nbsp;носков &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;SS&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; 2018 популярные Falke Tiago в\r\nнасыщенных оттенках синего и бирюзового отображают разные глубины океана, а\r\nприверженцы новых приключений оценят безоговорочный хит теплых дней Falke\r\nCool24/7 - элегантные матовые носки c охлаждающим эффектом для активных людей. Кроме\r\nэтого в мужском ассортименте представлены востребованные и любимые мужчинами\r\nноски, гольфы и степы, сезонные носки в полоску, точку и цветные паттерны -\r\nневероятно популярны, благодаря комфортной посадке и укрепленным стрессовым\r\nзонам, что обеспечивает высокую износостойкость.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Спортивная и линейка «Energizing» ваш залог успешного\r\nи комфортного досуга. Технологичность марки Falke - в особых нитях и плетении\r\nпутем двойного скручивания, что гарантирует высокую износостойкость и\r\nкомфортную посадку. Смесь высококачественного хлопка Piuma и тонкого Fil\r\nd‘Ecosse, шерсти викуньи и мериносовой шерсти, кашемира обеспечивают комфортную\r\nноску благодаря уникальным материалам.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','Мужские носки и одежда Falke |Little-House','Falke | носки и одежда в ассортименте. Высокое качество. И оригинальная продукция.',''),
	(75,2,'Menswear','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Мужская одежда F&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;alke&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Типичный образ F&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;alke&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; в этом сезоне отражает летний\r\nминимализм, который привлекает внимание исключительными деталями. Акценты задает\r\nсложный дизайнам и свежие штрихам спокойных оттенков. Мужские материалы\r\nконтрастируют с мягкими формами яркого стиля &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Falke&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Морской флер&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Синие оттенки цвета моря, светло-серые, как горные\r\nвершины, и ярко-оранжевые вызывают воспоминания о волнах и солнце. Морские\r\nсимволы, такие как якорь или парусное представляют собой прибрежный стиль в\r\nвиде полосок. Универсальные блейзеры из шерсти и хлопка, дополняют коллекцию\r\nсвоей элегантностью и изысканностью. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Ностальгия&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Летом шелк и лен играют большую роль и создают\r\nинтересный микс материалов во взаимодействии между волокнистыми структурами и\r\nэлегантным внешним видом. Этой спортивной одежде присущи земляные оттенки.\r\nПарка и блейзер из хлопка, шелка и льна, могут быть легко сброшены и дополнены\r\nшортами-бермудами и легким трикотажем.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Портофино&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Вдохновленный ретро-шиком итальянской дольче-вита 60-х\r\nи 70-х годов, &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Falke&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; представляет элегантный и городской стиль. Классические вещи, такие как\r\nкашемировый блейзер, а также куртки, кардиганы на молнии или поло с манжетами,\r\nсовмещают в себе ностальгический дизайн и современные тенденции. Визуальный\r\nэффект обеспечивают контрастирующие расцветки. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Джерси&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Повседневный и спортивный джерси просматривается во\r\nвсей коллекции. Одежда для отдыха, комбинируется с инновационными материалами,\r\nа также с тончайшими шелковыми, хлопковыми и или кашемировыми рубашками,\r\nхарактеризует индивидуальную летнюю тему. В коллекции также представлены\r\nморские символы с вышивкой на рукавах и на подоле отдельных рубашек и тонкими\r\nдекоративными швами контрастных цветов.&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','Мужская одежда  Falke Menswear |Little-House','Falke Menswear| Мужская одежда в ассортименте. Высокое качество. И оригинальная продукция.',''),
	(69,2,'Sport','&lt;p style=&quot;line-height: 1.2;&quot;&gt;&lt;span style=&quot;font-weight: bold; font-family: Arial;&quot;&gt;Спортивная линейка FALKE&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.2;&quot;&gt;&lt;span style=&quot;font-weight: bold; font-family: Arial;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.2;&quot;&gt;&lt;span style=&quot;font-family: Arial;&quot;&gt;A. &amp;nbsp; &amp;nbsp; &amp;nbsp;Skiing&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.2;&quot;&gt;&lt;span style=&quot;font-family: Arial;&quot;&gt;B. &amp;nbsp; &amp;nbsp; &amp;nbsp;Snowboarding&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.2;&quot;&gt;&lt;span style=&quot;font-family: Arial;&quot;&gt;C. &amp;nbsp; &amp;nbsp; &amp;nbsp;Running&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.2;&quot;&gt;&lt;span style=&quot;font-family: Arial;&quot;&gt;D. &amp;nbsp; &amp;nbsp; &amp;nbsp;Trekking&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.2;&quot;&gt;&lt;span style=&quot;font-family: Arial;&quot;&gt;E. &amp;nbsp; &amp;nbsp; &amp;nbsp;Tennis&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.2;&quot;&gt;&lt;span style=&quot;font-family: Arial;&quot;&gt;F. &amp;nbsp; &amp;nbsp; &amp;nbsp;Golf&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.2;&quot;&gt;&lt;span style=&quot;font-family: Arial;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.2;&quot;&gt;&lt;span style=&quot;font-family: Arial;&quot;&gt;Линия термобелья&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.2;&quot;&gt;&lt;span style=&quot;font-family: Arial;&quot;&gt;Выполнена из лучших экологически чистых и гиппоаллергенных материалов. Оно прекрасно согревает не за счет толщины вязки, а за счет использования уникальных технологий терморегуляции. В общем-то, вся продукция этого бренда изготавливается из тончайшей пряжи и соответствует высоким стандартам качества.&lt;/span&gt;&lt;/p&gt;','Спортивная одежда Falke |Little-House','Falke | Спортивная одежда в ассортименте. Высокое качество. И оригинальная продукция.',''),
	(67,2,'Women','&lt;p style=&quot;line-height: 1.2;&quot;&gt;&lt;span style=&quot;font-family: Arial; font-weight: bold;&quot;&gt;Falke Women&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Ультра-прозрачные, с эффектом «make-up» или легкого\r\nзагара, «дышащие» колготы, с блеском перламутра или матовые дополнят элегантный\r\nженский образ. Ультратонкие чулки Falke с эффектом «пудры» –\r\nбезупречный вариант для офисного дресс-кода, праздничного и вечернего наряда.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px; margin-bottom: 0px; color: rgb(90, 89, 89); font-family: Arial, serif; font-size: 14px; line-height: 1.2;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;Линейка Nostalgia&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Приглушенные, спокойные оттенки – белый, сепия и\r\nоливковый – великолепны в тандеме с прозрачными элементами или деталями\r\nлюрекса. Легкие, едва уловимые нити подчеркнут женственность образа и летящую\r\nпоходку стройных ног. Нежные цветочные узоры, графические вертикальные полоски\r\nс акцентами на сплошных колготках – безоговорочный тренд сезона. Изюминка для\r\nлета – тончайшие носки из органзы и невидимых кружев. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Линейка Euphoria&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Роскошная структура и цветочные узоры новых моделей\r\nнапоминают сицилийские пейзажи. Художники, создавшие эскизы, вдохновлялись\r\nморским дном Средиземного моря с его рифами. Это легко уловить в сверкающих\r\nэлементах, а также оттенках зеленого и синего. Приятный бонус – носки с\r\nдвухцветным эффектом можно носить с обеих сторон. Колготки из этой линейки\r\nдостойны внимания благодаря хрупкому кружеву. Раковины и сетчатые рисунки\r\nпридают женским ногам еще большую притягательность.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Denim линейка&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Неизменный тренд многих сезонов – одежда из денима.\r\nFalke, всегда стоящий на страже свежих тенденций, не позволил себе обойти этот\r\nфакт стороной. Бренд предлагает спортивные носки в длину кроссовок с\r\nминималистским рисунком и манжетами. В качестве альтернативы джинсам мастера\r\nмарки советуют предпочесть летние легинсы из тонкой ткани или с тональным\r\nкамуфляжем. Идеальны для солнечной погоды – женские носки с прозрачным\r\nкружевным и цветочным дизайном. Каждый аксессуар Falke говорит о безупречном\r\nвкусе его обладательницы, идущей в ногу со временем.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','Женские носки и одежда Falke |Little-House','Falke | женские носки и одежда. В ассортименте колготки,чулки, легинсы. Высокое качество. И оригинальная продукция.',''),
	(59,2,'Falke','&lt;p style=&quot;margin: 0cm 0cm 6.4pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Стремление украсить себя, продумывая каждую деталь\r\nобраза, присуще врожденным эстетам. Для тонких ценителей аксессуаров уже более\r\n120 лет работают мастера бренда &lt;span style=&quot;font-weight: bold;&quot;&gt;Falke.&lt;/span&gt; Коллекция В&lt;/span&gt;есна - Лето 2018 –\r\nизящный симбиоз эйфории и ностальгических чувств.&amp;nbsp;&lt;br&gt;\r\n&lt;!--[if !supportLineBreakNewLine]--&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0cm 0cm 6.4pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Стойкие перфекционисты, индивидуалисты и интеллектуалы\r\n– вот к кому обращено творчество немецкой марки. Именно на них ориентируются\r\nмастера в поисках идеальной формы и высокого качества ручной работы. Дизайн\r\nFalke – гармония ткани и цвета. Коллекции носков и колгот\r\nдля взрослых и детей созданы в порыве романтических ожиданий от путешествий,\r\nволнительных знакомств и свежих эмоций.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0cm 0cm 6.4pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0cm 0cm 6.4pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;font-size: 10pt; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;\r\n&lt;!--[endif]--&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0cm 0cm 6.4pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;font-size: 10pt; font-family: Arial, sans-serif;&quot;&gt;Небольшая трикотажная фабрика,\r\nоснованная в 1895 году Францом Фальке-Рохенем, и приобретенная спустя 7 лет\r\nвязальная фабрика в Шмалленберге выросли в процветающее мануфактурное\r\nпредприятие, а носочно-чулочные изделия ручной работы уже в настоящее время заслужили любовь миллионов клиентов по всему миру.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0cm 0cm 6.4pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;font-size: 10pt; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0cm 0cm 6.4pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;Миссия компании - изготовление\r\nвысококлассной продукции, которую будет приятно носить, и над решением этой\r\nзадачи ежедневно работает свыше 3000 сотрудников фирмы. Слоган компании –\r\nкачество во имя качества! Каждая деталь заслуживает быть доведенной до\r\nсовершенства.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0cm 0cm 6.4pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0cm 0cm 6.4pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0cm 0cm 6.4pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;Уникальность изделий Falke -\r\nэто многоплановость, особая технология плетения, уникальное сырье и смешение\r\nволокон.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0cm 0cm 6.4pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;line-height:115%;font-family:\r\n&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','Falke официальный интернет магазин носков и одежды |Little-House','Falke | носки, гольфы, подследники мужские, женские, детские. В ассортименте колготки,чулки, легинсы. Высокое качество. И оригинальная продукция.',''),
	(76,2,'Burlington','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Добавь цвета: стильные образы с яркими носками Burlington&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Любите нетрадиционные и уникальные образы? Тогда\r\nвесенне-летняя коллекция бренда с шотландскими корнями Burlington именно для\r\nвас.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;Носки уже давно перестали быть просто незаметным\r\nаксессуаром. Теперь они в центре внимания! Вне зависимости от того, что вы\r\nобычно носите — строгий костюм или девичий платье, правильные носки смогут\r\nстать центром образа. Главное — правильно их выбрать.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Вместе с брендом Burlington, который с 2008 года входит\r\nв состав компании Falke, узнайте про четыре самых интересных тренда\r\nбудущего сезона. Вдохновляйтесь и экспериментируйте!&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;br&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Ringlets and rib &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Рубчики и завитки придают свободный стиль носкам в\r\nбаскетбольном стиле, в них особенно чувствуется баланс спорта и свободного\r\nдуха. Лобстер по всей поверхности или лимон в качестве вышитого мотива, — ваши\r\nдрузья точно обратят на них внимание!&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Gothic&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Готический стиль не перестает быть в тренде.\r\nМеталлические акценты на черных носках Burlington придадут вашему образу\r\nоттенки настоящего рока. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Print &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Яркие гавайские цветы, незабываемые волны и принты\r\nлистьев прекрасно сочетаются с джинсами и брюками-чиносами, а без них не только\r\nлетом, но и в любой другой сезон никуда не спрятаться. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Transparency, nets and sparkles&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;В новом сезоне будут популярны всевозможные эффекты\r\nпрозрачности: необычные структурные выточки, сетка или прозрачный ромб. А\r\nнеобычная пряжа и люрексовые акценты в сочетании с графикой и всевозможными\r\nвариантами блеска на многоцветной пряже обеспечат женственность вашего образа.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','Одежда  Falke Burlington |Little-House','Falke Burlington| Оригинальная одежда в ассортименте. Высокое качество. ',''),
	(60,2,'Roeckl','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Сокровище прошлого, наполненное духом юности, вот, что\r\nпревращает&lt;b&gt; Roeckl &lt;/b&gt;в уникальный\r\nбренд, а также служит вдохновением коллекции Весна – Лето 2018. Сила\r\nтрадиционной компании лежит в ее способности меняться с течением времени, не\r\nтеряя своей идентичности. Мастерство было одной из основополагающей ценностью\r\nбренда с 1839 года. Премиум-класса аксессуары ручной работы — это шедевры\r\nремесленничества. Каждая модель отражает непреодолимую красоту и вневременную\r\nэлегантность.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;В первую очередь &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Roeckl&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; известен благодаря элегантным перчаткам\r\nиз нежной кожи, повторяющих каждое движение руки. Но, немало важным\r\nнаправлением бренда уже много лет остаются изысканные платки и шали из\r\nблагородного шелка с изящными орнаментами.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;4 направления коллекции Весна - Лето 2018&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;URBAN&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Яркие, смелые цвета, такие как лимонный, голубой и\r\nконфетный, создают динамичный &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;look&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;, который излучает радость и уверенность. Такие цвета остаются одновременно\r\nспортивными и гламурными. Пастельные тона, ясные и спокойные оттенки\r\nконтрастируют в стиле &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;urban&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;chic&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;SAMARKAND&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Насыщенные оттенки синей плитки майолики и витиевато\r\nукрашенных куполов простираются на тонком шелке, словно настоящие шедевры.\r\nСамарканд, мифический город на Шелковом Пути, переносит нас в мир волшебных\r\nмавританских орнаментов и возвращает к традициям прежних декоративных ремесел,\r\nкоторые, словно великие кутюрье, освоили мастера &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;ROECKL&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;TROPICAL&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Атмосфера божественной флоры и фауны. Встреча смелых,\r\nдерзких и радостных цветов и цветочных элементов декора. Интенсивные цвета и\r\nлетние элементы сливаются в настоящий тропический &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;look&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;NEUTRALS&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Слияние различных культур и современного пуризма\r\nсоздают уникальный, естественный и вневременный стиль. Утонченный, но в тоже\r\nвремя многогранный дизайн изделий &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;ROECKL&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; выражается в использовании множества натуральных\r\nматериалов, но поистине идеальным, простым и в тоже время важным остается\r\nнатуральная кожа.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','Roeckl в Украине |Little-House','Roeckl| Магазин оригинальной продукции. Высокое качество. Купить продукцию в Киеве',''),
	(78,2,'Платки и шали','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Платок от &lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Roeckl&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; &lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;– шёлковый шедевр.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Особое место в коллекции &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Roeckl&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; занимают шикарные, шали и платки и мы\r\nне перестаём впечататься мастерством, невероятной красотой и качеством этих\r\nизделий.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;Такой модный аксессуар, как платок способен украсить\r\nлюбую девушку. Его можно завязывать разными способами, чтобы день за днем\r\nвыглядеть по-новому и при этом безумно привлекательно, что особенно актуально\r\nдля нас женщин.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Коллекция платков Весна - Лето 2018 отражает\r\nбезупречную красоту природы: блестящий шёлк, воздушные материалы, шифон, цвета\r\nпастельный, кофейный, горчичный с акцентными принтами. Мягкий и нежно\r\nструящийся на коже материал – шёлк. Ни один другой натуральный материал не\r\nпредлагает таких идеальных условий для создания ярких цветовых сочетаний, как\r\nэта тонкая ткань.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;br&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;Каждый платок – это произведение искусства,\r\nсоздающееся в результате сложного многоступенчатого процесса: от разработки\r\nрисунка и цветовой композиции до дорогостоящей шаблонной печати, и ручной\r\nобработки края. Сначала разрабатывается дизайн платка и филигранно обрисовывается\r\nвручную во всем многоцветье. Так под кисточкой художника возникает живой\r\nхарактер, который делает каждый платок неповторимым.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;br&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;Для нанесения рисунка на шёлковый платок в итальянском\r\nгороде Комо каждая краска смешивается, дозируется и наносится отдельно слой за\r\nслоем с использованием ручного труда. В результате первого этапа печати\r\nвозникают контуры узора. Затем отдельно наносится каждый цвет, присутствующий\r\nна платке. После каждого нанесения краски платок должен полностью высохнуть.\r\nЗатем происходит процесс фиксации и окончательной обработки шёлка. В заключение\r\nшвеи искусно обрабатывают края платка вручную&lt;/span&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Шарфы и платки есть в любом гардеробе, но мы не\r\nиспользуем их огромный потенциал на полную. Так, например, шаль или платок\r\nявляются самыми незаменимыми атрибутами в путешествии. В действительности,\r\nничто так не украшает нас и не придаёт столько женственности, как красиво\r\nповязанный платок. Как известно, существует множество способов ношения платка,\r\nкоторые вам представят опытные стилисты магазинов &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Roeckl&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','Шали  Roeckl | Little-House','Roeckl| Оригинальные шали в ассортименте. Высокое качество. ',''),
	(79,2,'Сумки','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Сумочка &lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Roeckl&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; – превосходная спутница в любой\r\nситуации.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Простые формы, неимоверные цветовые решения превращают\r\nсумки Roeckl в ключевых игроков fashion рынка. Требования к качеству, которые бренд\r\nпредъявляет к сумкам, можно обозначить одним словом: перфекционизм. Высококачественную\r\nкожу получает с европейских дубильных предприятий. Такими же качественными\r\nдолжны быть и другие используемые материалы: металлическая отделка из чистой\r\nлатуни, материал для подклада. Все тщательно отобрано, безупречно по качеству и\r\nслужит всю жизнь, и даже дольше.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Производственные филиалы находятся в Европе, таким образом\r\n&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Roeckl&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; может гарантировать высокие стандарты мастерства своих сотрудников и\r\nкачество их работы. Для изготовления сумки необходимо до 150-и отдельных\r\nдеталей. В каждой детали ощущается отдача мастера, с которой он создавал свой\r\nпродукт. При всем обилии инновационных решений основные техники производства за\r\nпоследние столетия не претерпели существенных изменений. Многие операции до сих\r\nпор проводятся вручную. Только в результате таких неимоверных затрат можно\r\nизготовить из драгоценной кожи уникальный шедевр. А ведь каждая сумка &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Roeckl&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; действительно уникальна.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','Сумки  Roeckl в Украине | Little-House','Roeckl| Оригинальные сумки в ассортименте. Высокое качество. Купить продукцию в Киеве',''),
	(110,2,'FiftySeven','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Истинно премиальный - слова, которые отражают качество\r\nколлекции одежды для младенцев &lt;/span&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Sanetta&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;FiftySeven&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;.&lt;/span&gt; &lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Детская одежда в размерах 56-86 произведена в классическом дизайне, с\r\nнеобыкновенным вниманием к деталям и базовым тканям, мягким и невероятно\r\nприятным на ощупь. Производятся изделия в Европе с использованием органического\r\nхлопка. Как и вся продукция &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Sanetta&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;, коллекция &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;FifitySeven&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; медицински тестирована, что особенно важно для маленьких клиентов,\r\nбесшовна и ни одна деталь, пряжа, краски или фурнитура не представляют никакой\r\nопасности для здоровья младенцев.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','Steiff| Оригинальная в Украине. Высокое качество. ','Sanetta  FiftySeven| Оригинальная детская одежда в Украине. Высокое качество.',''),
	(152,2,'Sanetta','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Sanetta &lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;- один из знаковых брендов компании Little\r\nHouse. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Элегантные по своему дизайну пижамы, халаты, с милыми\r\nи в каждом сезоне новыми принтами на нежных тканях безусловно подходят девочкам\r\nи мальчикам. Кроме пижам и халатов, бренд выпускает полную линейку детского\r\nбелья. Такие пижамы теперь точно станут надежными спутниками деток.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Мастера Sanetta также талантливы в инновациях. Как\r\nинициатор нескольких медицинских стандартов, бренд с гордостью воплотили их в\r\nсобственную производственную линию. С помощью комплексного процесса все материалы\r\nпроходят испытание на биосовместимость с клетками кожи, а краска и фурнитура,\r\nне представляют никакой опасности для здоровья. Детское белье и пижамы\r\nпроизводится из органического хлопка, который поступает на фабрики из\r\nконтролируемых хозяйств. Этот хлопок не содержит пестицидов, что важно не\r\nтолько для нас, но и для окружающей среды. Изделия имеют удобную посадку, не\r\nжмут, швы не кусаются и не перекручиваются, изделия долго носятся, при этом не\r\nдают усадки и их форма не меняется. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Даже самому подвижному ребенку будет комфортно и\r\nбезопасно в пижамах &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;S&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;anetta. Просто идеально для ваших детей.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Коллекция Весна – Лето 2018.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;br&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;Коллекция Race&lt;/span&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Встречайте весну стремительно с классической\r\nколлекцией &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Sanetta&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt; для мальчиков, в которой мы глубоко погружаемся в мир гонок. Дизайнеры\r\nактивно вдохновились мотоспортом с его характерными принтами и смелыми\r\nимиджами. Оттенки тканей – полуночный синий, бургунди, меланж. В новой\r\nколлекции пижам – новые меланжевые оттенки тканей выполнены из 100% хлопка, а\r\nразнообразие тематик продолжает радовать любителей немецкого бренда.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Athleisure Black&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Тема активного отдыха в этом сезоне остается все также\r\nактуальной. Следуя успеху коллекции для девочек Girl Power, в этом сезоне\r\nSanetta предлагает капсульную коллекцию одежды для спорта и отдыха для\r\nмальчиков в размере 128-188.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;13 элементов одежды легко сочетаются между собой\r\n(mix-and-match), они спокойны, даже иногда вальяжны, но спортивные, выполнены в\r\nчерном, бледно сером и белом цвете, а неоновый зеленый привносит колорит.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Спортивные штаны - джогерры и шорты комбинируются с\r\nхуди и футболками с принтами слегка увеличенных размеров, простыми слоганами и\r\nнеоновыми деталями. Доминирует черный и разнообразные оттенки серого. Мягкий\r\nтонкий трикотаж, французская мохра и смесь высококачественных материалов\r\nиспользованы не только, чтобы дополнить совместимые образы, но и обеспечить\r\nполноценный комфорт.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Athleisure Blue&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Первым делом –девушки! Вот слоган новой коллекции\r\nлаунж одежды для девочек серии Girl Power. Линейка нижнего белья этой\r\nспортивной капсулы и кроме бюстье, спортивных бра и хипстеров, теперь включает\r\nв себя топы и брифы-рио со стильным тканным люрексовым поясом (доступны в\r\nразмерах 128 – 176). Основными оттенками остается белый с новым синим – цвет\r\nледяных фьордов Норвегии. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;18 элементов одежды легко сочетаются между собой\r\n(mix-and-match) и включают: обновленные штаны-джоггеры, легинсы-капри и шорты,\r\nа также топы с открытыми плечами. Спортивные детали&amp;nbsp; такие как шнурки, отделка в рубчик, и чистые\r\nтипографические принты впечатляют.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Silver Line&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Первая из наших ослепительных коллекций для девочек\r\nподростков выполнена в белой и светло-серой цветовой гамме под лозунгом Луч\r\nнадежды. Сложные минималистичные принты, люрексовые полоски и сдержанные\r\nокантовки отражают чистоту коллекции.&amp;nbsp;&amp;nbsp; В\r\nночных сорочках - округлые формы ворота, в пижамах -&amp;nbsp; элегантные вырезы на плечах и укороченные\r\nштаны. Использование модала, люрексовых швов и вставок из кружева улучшают\r\nвнешний вид изделий.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Spring Girls&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif;&quot;&gt;Весенние девушки в Sanetta – одновременно спортивны и\r\nженственны. Сочетание серого, оттенков сорбета, пыльной розы и аква помогают\r\nзадать здесь тон. Цветочные принты и разнообразие цветовой гаммы отображают\r\nатмосферу свежести. Н&lt;/span&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;еоновые полоски и тканые элементы компенсируются\r\nдевичьими цветочными узорами с легким прикосновением спортивного стиля. Ночные\r\nсорочки, пижамы с короткими или длинными штанами и комбинезоны легко миксовать\r\nмежду собой, создавая свои уникальные комплекты.&lt;/span&gt;&lt;/p&gt;','Одежда для детей и подростков Sanetta в Украине | Little-House','Sanetta | Оригинальная одежда для детей и подростков в Украине. ',''),
	(61,2,'Hanro','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:10.0pt;line-height:\r\n115%;color:#595959;mso-themecolor:text1;mso-themetint:166;mso-style-textfill-fill-color:\r\n#595959;mso-style-textfill-fill-themecolor:text1;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:&amp;quot;lumm=65000 lumo=35000&amp;quot;;\r\nmso-ansi-language:EN-US&quot;&gt;HANRO&lt;/span&gt;&lt;/b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:\r\n10.0pt;line-height:115%;color:#595959;mso-themecolor:text1;mso-themetint:166;\r\nmso-style-textfill-fill-color:#595959;mso-style-textfill-fill-themecolor:text1;\r\nmso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\n&amp;quot;lumm=65000 lumo=35000&amp;quot;;mso-ansi-language:EN-US&quot;&gt;&amp;nbsp;&lt;b&gt;of Switzerland&lt;/b&gt; – Pure Luxury On Skin.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;line-height:115%;color:#595959;\r\nmso-themecolor:text1;mso-themetint:166;mso-style-textfill-fill-color:#595959;\r\nmso-style-textfill-fill-themecolor:text1;mso-style-textfill-fill-alpha:100.0%;\r\nmso-style-textfill-fill-colortransforms:&amp;quot;lumm=65000 lumo=35000&amp;quot;&quot;&gt;Крупнейший в\r\nмире производитель элитного нижнего белья, одежды для сна и lounge одежды для\r\nмужчин и женщин с более чем 130-ти летней историей.&amp;nbsp; Предприятие работает с момента его основания\r\nв 1884 году Альбертом Хандшином и Карлом Ронусом в швейцарском Листале и до сих\r\nпор сосредоточено в Европе, что позволяет поддерживать контроль качества\r\nпроизводства на всех этапах.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;line-height:115%;color:#595959;\r\nmso-themecolor:text1;mso-themetint:166;mso-style-textfill-fill-color:#595959;\r\nmso-style-textfill-fill-themecolor:text1;mso-style-textfill-fill-alpha:100.0%;\r\nmso-style-textfill-fill-colortransforms:&amp;quot;lumm=65000 lumo=35000&amp;quot;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;line-height:115%;color:#595959;\r\nmso-themecolor:text1;mso-themetint:166;mso-style-textfill-fill-color:#595959;\r\nmso-style-textfill-fill-themecolor:text1;mso-style-textfill-fill-alpha:100.0%;\r\nmso-style-textfill-fill-colortransforms:&amp;quot;lumm=65000 lumo=35000&amp;quot;&quot;&gt;Продукция\r\nHANRO в каждой ниточке воплощает швейцарскую эстетику и стиль жизни, которую\r\nразделяют звезды Голливуда: Николь Кидман, Роберт Де Ниро, Дженифер Энистон,\r\nБрюс Уиллис, Дениель Крейг и другие актеры первого эшелона. Принцесса Монакская\r\nКаролина, шейх Рашид ибн Саид Аль Мактум, королева Иордании Рания ценят бренд\r\nза его классический стиль, элегантный, изысканный дизайн.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;line-height:115%;color:#595959;\r\nmso-themecolor:text1;mso-themetint:166;mso-style-textfill-fill-color:#595959;\r\nmso-style-textfill-fill-themecolor:text1;mso-style-textfill-fill-alpha:100.0%;\r\nmso-style-textfill-fill-colortransforms:&amp;quot;lumm=65000 lumo=35000&amp;quot;&quot;&gt;&lt;br&gt;\r\nТщательный подбор материалов из ценных натуральных волокон, не подверженный\r\nвлиянию моды дизайн в сочетании с техническими инновациями превращают HANRO в\r\nнеповторимую торговую марку.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.2;&quot;&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;line-height:115%;color:#595959;\r\nmso-themecolor:text1;mso-themetint:166;mso-style-textfill-fill-color:#595959;\r\nmso-style-textfill-fill-themecolor:text1;mso-style-textfill-fill-alpha:100.0%;\r\nmso-style-textfill-fill-colortransforms:&amp;quot;lumm=65000 lumo=35000&amp;quot;&quot;&gt;Шелк, хлопок\r\nКарибских островов, кашемир и мериносовая шерсть обрабатываются с помощью\r\nсовременных технологий производства, например, бесшовной\r\nобработкой&amp;nbsp;&amp;nbsp;и&amp;nbsp;&amp;nbsp;мягкой&amp;nbsp;&amp;nbsp;мерсеризации, что в\r\nкомбинации с французской тесьмой и швейцарскими вышивками превращает изделия в\r\nактуальное во все времена элегантное нижнее белье.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','Hanro| Оригинальное мужское и женское белье. Высокое качество. ','Женское и мужское белье Hanro | Little-House','');
