	(7,2,'Наши магазины','&lt;div class=&quot;col-sm-4&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;FALKE&lt;/span&gt;&lt;br&gt;ЦУМ Киев, -1 этаж мужской, 3 женский&lt;br&gt;ТРЦ GULLIVER, 1 этаж&lt;br&gt;044-585-85-51&amp;nbsp;&lt;br&gt;&lt;br&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;HANRO&lt;/span&gt;&lt;br&gt;ЦУМ Киев, -1 этаж мужской, 3 женский&lt;br&gt;&lt;br&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;ROECKL&lt;/span&gt;&lt;br&gt;ЦУМ Киев, 1 этаж&lt;br&gt;ТРЦ GULLIVER, 1 этаж&amp;nbsp;&lt;br&gt;095-280-55-80&lt;br&gt;&lt;/div&gt;&lt;div class=&quot;col-sm-4&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;ELSY&lt;/span&gt;&lt;br&gt;ЦУМ Киев, 5 этаж&lt;br&gt;ТРЦ GULLIVER, 4 этаж&lt;br&gt;044-585-50-95&lt;br&gt;&lt;br&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;FALKE Kids&lt;/span&gt;&lt;br&gt;ЦУМ Киев: 5 этаж&lt;br&gt;ТРЦ GULLIVER, 4 этаж&lt;br&gt;044-585-85-52&lt;br&gt;&lt;br&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Steiff&lt;/span&gt;&lt;br&gt;ЦУМ Киев, 5 этаж&lt;br&gt;ТРЦ GULLIVER, 4 этаж&lt;br&gt;044-585-50-95&lt;br&gt;&lt;/div&gt;&lt;div class=&quot;col-sm-4&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Sanetta&lt;/span&gt;&lt;br&gt;ЦУМ Киев, 5 этаж&lt;br&gt;ТРЦ GULLIVER, 4 этаж&lt;br&gt;044-585-58-59&lt;br&gt;&lt;br&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;TOP Model&lt;/span&gt;&lt;br&gt;ЦУМ Киев, 5 этаж&lt;br&gt;ТРЦ GULLIVER, 4 этаж&lt;br&gt;044-585-50-95&lt;br&gt;&lt;p&gt;&lt;/p&gt;&lt;/div&gt;','Наши магазины','',''),
	(6,2,'Delivery Information','&lt;p&gt;\r\n	Delivery Information&lt;/p&gt;\r\n','Delivery Information','',''),
	(8,2,'Наши бренды','&lt;p class=&quot;text-justify&quot; style=&quot;margin-bottom: 10px;&quot;&gt;&lt;span style=&quot;padding: 0px; margin: 0px; text-align: left; font-weight: bold;&quot;&gt;Falke&lt;/span&gt;&lt;span style=&quot;text-align: left;&quot;&gt;&amp;nbsp;- высокотехнологичные носочно-чулочные изделия для мужчин, женщин и детей - линии бизнес, фешн, кежуал и спорт.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;text-justify&quot; style=&quot;margin-bottom: 10px;&quot;&gt;&lt;br style=&quot;padding: 0px; margin: 0px; text-align: left;&quot;&gt;&lt;span style=&quot;padding: 0px; margin: 0px; text-align: left; font-weight: bold;&quot;&gt;Roeckl&lt;/span&gt;&lt;span style=&quot;text-align: left;&quot;&gt;&amp;nbsp;– 175-летний бренд из Германии, производитель высококачественных перчаток, платков, сумок и&amp;nbsp;шарфов.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;text-justify&quot; style=&quot;margin-bottom: 10px;&quot;&gt;&lt;br style=&quot;padding: 0px; margin: 0px; text-align: left;&quot;&gt;&lt;span style=&quot;padding: 0px; margin: 0px; text-align: left; font-weight: bold;&quot;&gt;Hanro&lt;/span&gt;&lt;span style=&quot;text-align: left;&quot;&gt;&amp;nbsp;– швейцарский бренд белья для мужчин и женщин, роскошь в мастерстве и лаконичных дизайн-решениях.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;text-justify&quot; style=&quot;margin-bottom: 10px;&quot;&gt;&lt;br style=&quot;padding: 0px; margin: 0px; text-align: left;&quot;&gt;&lt;span style=&quot;padding: 0px; margin: 0px; text-align: left; font-weight: bold;&quot;&gt;Steiff&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-align: left;&quot;&gt;– легендарный бренд из Германии, родоначальник плюшевых игрушек со 130-летней историей, представлен детской одеждой до 6 лет, игрушками и аксессуарами.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;text-justify&quot; style=&quot;margin-bottom: 10px;&quot;&gt;&lt;br style=&quot;padding: 0px; margin: 0px; text-align: left;&quot;&gt;&lt;span style=&quot;padding: 0px; margin: 0px; text-align: left; font-weight: bold;&quot;&gt;Sanetta&lt;/span&gt;&lt;span style=&quot;text-align: left;&quot;&gt;&amp;nbsp;- немецкий экологичный бренд детского белья, пижам и одежды для дома для детей от 0 до 16 лет.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;text-justify&quot; style=&quot;margin-bottom: 10px;&quot;&gt;&lt;br style=&quot;padding: 0px; margin: 0px; text-align: left;&quot;&gt;&lt;span style=&quot;padding: 0px; margin: 0px; text-align: left; font-weight: bold;&quot;&gt;Elsy&lt;/span&gt;&lt;span style=&quot;text-align: left;&quot;&gt;&amp;nbsp;– итальянский бренд, предлагающий стильную и элегантную одежду для девочек от 1 года до 16 лет&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;text-justify&quot; style=&quot;margin-bottom: 10px;&quot;&gt;&lt;br style=&quot;padding: 0px; margin: 0px; text-align: left;&quot;&gt;&lt;span style=&quot;text-align: left; font-weight: bold;&quot;&gt;Top Model&lt;/span&gt; - трендовая аксессуарная и подарочная продукции для детей и подростков.&lt;/p&gt;','Бренды компании Little-House','Компания Little-House  в Украине. Владелец сети магазинов таких брендов: FALKE, ROECKL, HANRO, STEIFF, SANETTA, ELSY',''),
	(13,2,'Магазины','&lt;p&gt;Описание страницы &quot;Наши магазины&quot;&lt;/p&gt;','Наши магазины','',''),
	(4,2,'О нас','&lt;div&gt;&lt;span&gt;&lt;b&gt;Little House&lt;/b&gt;&amp;nbsp;- сеть мультибрендовых магазинов детской одежды, аксессуаров и игрушек от лучших Европейских брендов класса премиум, де- люкс: Steiff, Sanetta, F&lt;span&gt;alke Kids&lt;/span&gt;,&amp;nbsp;Elsy, TOPModel и других.&amp;nbsp;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;Сеть&amp;nbsp;&lt;b&gt;Little House&amp;nbsp;&lt;/b&gt;входит в группу компаний&lt;b&gt;&amp;nbsp;LH Group,&amp;nbsp;&lt;/b&gt;которая официально представляет на рынке Украины премиальные европейские бренды в детском и взрослом сегментах рынка, как оптом, так и монобрендовыми розничными магазинами.&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;Бренды детского направления:&amp;nbsp;&lt;b&gt;Steiff, Sanetta, F&lt;/b&gt;&lt;span&gt;&lt;b&gt;alke Kids&lt;/b&gt;&lt;/span&gt;&lt;b&gt;,&amp;nbsp;&lt;/b&gt;&lt;b&gt;Elsy, TOPModel&lt;/b&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;Бренды взрослого направления&lt;span&gt;:&lt;/span&gt;&lt;span&gt;&lt;b&gt;&amp;nbsp;&lt;/b&gt;&lt;/span&gt;&lt;b&gt;Falke&lt;/b&gt;&lt;span&gt;&lt;b&gt;,&amp;nbsp;&lt;/b&gt;&lt;/span&gt;&lt;b&gt;Hanro&lt;/b&gt;&lt;span&gt;&lt;b&gt;,&lt;/b&gt;&lt;/span&gt;&lt;span&gt;&lt;b&gt;&amp;nbsp;&lt;/b&gt;&lt;/span&gt;&lt;b&gt;Roeckl&lt;/b&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;Бренды официально представлены в Киеве концептуальными монобрендовыми магазинами, расположенными в ТРЦ Gulliver, монобрендовыми корнерами в ЦУМ Киев и мультибрендовыми магазинами Little House в ТРЦ Art Mall, ТРЦ Sky Mall, ТРЦ Ocean Plaza и&amp;nbsp;ЦУМ Киев.&amp;nbsp;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&lt;b&gt;Наша миссия&lt;/b&gt;&amp;nbsp;через наш продукт представлять такие ценности как уважение, доверие, забота, выраженные в комфортности, экологичности, стиле и высокой технологичности.&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;Натуральные ткани, удобный крой, гармония лаконичности и элегантности - все эти элементы заложены в ДНК продукции, представленной &amp;nbsp;&lt;b&gt;LH Group&lt;/b&gt;.&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&lt;b&gt;&lt;u&gt;Наши бренды&lt;/u&gt;&lt;/b&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&lt;b&gt;&lt;u&gt;&lt;br&gt;&lt;/u&gt;&lt;/b&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&lt;b&gt;Sanetta&amp;nbsp;&lt;/b&gt;- немецкий производитель&amp;nbsp;детского белья, одежды для сна и для дома для детей от рождения до 16 лет.&amp;nbsp;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;Семейное предприятие более 60 лет производит высококачественные трикотажные изделия для детей и уделяет особое внимание экологичности и чистоте. Имеет ряд престижных сертификатов и стандартов качества.&amp;nbsp;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;Изделия отличает удобный крой и комфорт для нежной кожи ребенка, элегантный дизайн, долговечность и широкий ассортимент.&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;Подбренд Sanetta Fiftyseven производит красивую и удобную одежду для малышей до 2-х лет.&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&lt;b&gt;Steiff&lt;/b&gt;&lt;/span&gt;&lt;span&gt;&amp;nbsp;- известный немецкий бренд, изобретатель&amp;nbsp;&lt;/span&gt;&lt;span&gt;плюшевых зверей и культовых медведей Тедди. Бренд более 130 лет работает в индустрии игрушек на самом высоком уровне. Изделиям характерен особый дизайн, воссоздающий черты реального животного, чистота и качество материалов, особые выпуски,&lt;/span&gt;&lt;span style=&quot;font-size: 14.67px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14.67px;&quot;&gt;имеющие коллекционный статус и выпускающиеся лимитированными сериями.&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;Также бренд выпускает коллекцию одежды для новорожденных и детей до 6 лет, с милым символом мишки на каждом изделии.&amp;nbsp;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;Линейка одежды для новорожденных обладает богатым ассортиментом,&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14.67px;&quot;&gt;удобным, комфортным кроем, сертификатами качества, &amp;nbsp;предусмотренного для новорожденных, в коллекции особое место занимают аксессуары для младенцев - пледы, полотенца, подушки, пеленки.&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&lt;b&gt;Elsy&lt;/b&gt;&lt;/span&gt;&lt;span&gt;&amp;nbsp;– итальянский fashion бренд изысканной и стильной одежды для юных Леди. Бренд более 60 лет производит модную, дизайнерскую&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14.67px;&quot;&gt;одежду для девочек от 1 года до 16 лет.&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;Ассортимент разделен на 2 линейки - Baby и Girl. Вся коллекция бренда имеет 5 капсул каждый сезон, каждая капсула построена по принципу&amp;nbsp;&lt;/span&gt;&lt;span&gt;&lt;i&gt;total look.&amp;nbsp;&lt;/i&gt;&lt;/span&gt;&lt;span&gt;Изделия отличает&lt;/span&gt;&lt;span&gt;&lt;i&gt;&amp;nbsp;&lt;/i&gt;&lt;/span&gt;&lt;span&gt;модный&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14.67px;&quot;&gt;трендовый&lt;/span&gt;&lt;span&gt;&amp;nbsp;дизайн, внимание к деталям,&amp;nbsp;&lt;/span&gt;&lt;span&gt;элегантность и комфорт.&amp;nbsp;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&amp;nbsp;&lt;b&gt;TOPModel&lt;/b&gt;&amp;nbsp;– немецкий производитель развивающей полиграфии и игрушек, стильных, дизайнерских аксессуаров, канцелярии и школьных принадлежностей для девочек и мальчиков. Продукцию отличает яркий дизайн, высокое качество полиграфии и чистота используемых материалов и красителей, согласно Европейским директивам о безопасности продукции для детей.&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&lt;b&gt;H&lt;/b&gt;&lt;span&gt;&lt;b&gt;anro&lt;/b&gt;&lt;/span&gt;&amp;nbsp;- швейцарский производитель элитного белья и роскошной лаунж одежды для мужчин и женщин.&amp;nbsp;Бренд более 130 лет использует&amp;nbsp;в производстве наиболее чистый, мягкий хлопок и изысканные кружева. Продукция имеет лаконичный элегантный вид, идеальную посадку по фигуре, с обязательным условием комфортных ощущений на коже. Бренд получил международное признание и особую любовь звезд Голливуда&amp;nbsp;и семей аристократов, в том числе благодаря успешному использованию продукции при съемках Голливудских фильмов.&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&lt;b&gt;Falke&lt;/b&gt;&amp;nbsp;- немецкий производитель носочно-чулочной и трикотажной продукции, семейное предприятие семьи Falke в четвертом поколении.&amp;nbsp;&lt;span&gt;Б&lt;/span&gt;лагодаря уникальным технологиям и высочайшему качеству исполнения продукция бренда более 120 лет сочетает в себе идеальную посадку, эстетику, долговечность, технологичность и максимальный комфорт.&amp;nbsp;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;Линейки&amp;nbsp;&lt;/span&gt;&lt;span&gt;Falke&lt;/span&gt;&lt;span&gt;: носки и к&lt;/span&gt;&lt;span style=&quot;font-size: 14.67px;&quot;&gt;олготы&lt;/span&gt;&lt;span&gt;&amp;nbsp;для взрослых и детей, спортивная и функциональная одежда, мужской трикотаж и женские боди.&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;Также представлен шотландский&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14.67px;&quot;&gt;носочно-чулочный&amp;nbsp;&lt;/span&gt;&lt;span&gt;бренд&amp;nbsp;&lt;/span&gt;&lt;span&gt;&lt;b&gt;Burlington&lt;/b&gt;&lt;/span&gt;&lt;span&gt;, приобретенный Falke 2010 году.&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&amp;nbsp;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span&gt;&lt;b&gt;Roeckl&lt;/b&gt;&amp;nbsp;- ведущий немецкий производитель высококачественных кожаных перчаток и модных аксессуаров: платки, шали, шарфы, сумки и головные уборы. Более 175 лет это семейное предприятие-мануфактура семьи&amp;nbsp;Roeckl&lt;b&gt;&amp;nbsp;&lt;/b&gt;успешно сочетает традиции кожевенного мастерства и современные технологии, с 1873 года носит титул официального поставщика&amp;nbsp;&lt;i&gt;Баварского и Австрийского Королевского Двора&lt;/i&gt;.&lt;/span&gt;&lt;/div&gt;','О Компании Little House','Компания Little-House  в Украине. Владелец сети магазинов таких брендов: FALKE, ROECKL, HANRO, STEIFF, SANETTA, ELSY',''),
	(12,2,'Опт','&lt;p&gt;Компания Little House является официальным представителем на Украине таких брендов, как Falke, Hanro, Roeckl, Sanetta, Steiff, Elsy, TOPModel.&lt;/p&gt;&lt;p&gt;Мы активно развиваем оптовую деятельность в регионах Украины и будем рады сотрудничать с клиентами, имеющими магазины в городах-миллионниках: Одесса, Днепр, Львов, Харьков, а также в других городах Украины.&lt;/p&gt;&lt;p&gt;Вся продукция доступна с наших складов в Киеве, а также по предзаказу с Европы.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;h3&gt;По вопросам сотрудничества и предложений обращайтесь&lt;/h3&gt;&lt;p&gt;&lt;a href=&quot;mailto:opt@little-house.com.ua&quot; style=&quot;font-weight: bold;&quot;&gt;opt@little-house.com.ua&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;С удовольствием ответим на возможные вопросы!&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;','Оптовым клиентам Falke, Hanro, Roeckl, Sanetta, Steiff, Elsy, TOPModel.','','');
