INSERT INTO `oc_newsblog_article_description` (`article_id`, `language_id`, `name`, `preview`, `description`, `tag`, `meta_title`, `meta_h1`, `meta_description`, `meta_keyword`)
VALUES
	(1,2,'Старший продавец - консультант','Приглашаем к сотрудничеству &quot;Старший продавец-консультант в ЦУМ&quot;','&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Основные требования:&lt;/span&gt;&lt;/p&gt;&lt;ul style=&quot;padding: 0px 0px 0px 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;&quot;&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;опыт работы в luxury \\ премиум рознице не менее 2 лет&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;опыт работы с премиальными марками одежды и/или обуви&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;навыки успешных продаж и коммуникации с клиентами премиального уровня&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;личные качества: активная жизненная позиция, желание развиваться и достигать поставленных целей, грамотная речь, коммуникабельность, ответственность, инициативность, высокая исполнительность и обязательность.&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Основные обязанности:&lt;/span&gt;&lt;/p&gt;&lt;ul style=&quot;padding: 0px 0px 0px 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;&quot;&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;обеспечение высокого уровня обслуживания клиентов&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;осуществление активных продаж&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;обеспечение порядка в презентации продукции и торгового зала&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Условия работы&lt;/span&gt;:&lt;/p&gt;&lt;ul style=&quot;padding: 0px 0px 0px 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;&quot;&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;ЦУМ&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;оригинальная форменная одежда&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;заработная плата от 8 000 грн + мотивационные бонусы&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;официальное трудоустройство и удобный график&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;возможность карьерного роста&lt;/li&gt;&lt;/ul&gt;','','Вакансии компании Little-House','','',''),
	(28,2,'Красавица и чудовище','&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;STEIFF на премьерном показе анимационной ленты &quot;Балерина&quot; 18 января компания Little House представила корнер эксклюзивных брендов&lt;br&gt;&lt;/span&gt;&lt;/p&gt;','&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;STEIFF на премьерном показе анимационной ленты &quot;Балерина&quot;.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt; 18 января компания Little House представила корнер эксклюзивных брендов на премьерном показе анимационной ленты &quot;Балерина&quot; в Кинотеатр &quot;Оскар&quot;. Гостей ждали игрушки Margarete Steiff GmbH, коллекция одежды для девочек в балетном стиле ELSY, самые удобные пижамы Sanetta и аксессуары TOP Model.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;','',' Little House представила корнер эксклюзивных брендов','','',''),
	(8,2,'Вечер сказок в детском бутике Steiff','&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Детский бренд Steiff, который был основан еще в XIX веке в Германии и любим малышами всей Европы, провел в своем киевском бутике настоящий вечер сказок.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;a href=&quot;http://vogue.ua/article/fashion/shopping/vecher-skazok-v-detskom-butike-steiff.html&quot; target=&quot;_blank&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;Отчет о мероприятии у наших партнеров Vogue&lt;/a&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;','&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Детский бренд Steiff, который был основан еще в XIX веке в Германии и любим малышами всей Европы, провел в своем киевском бутике настоящий вечер сказок.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;a href=&quot;http://vogue.ua/article/fashion/shopping/vecher-skazok-v-detskom-butike-steiff.html&quot; target=&quot;_blank&quot;&gt;Отчет о мероприятии у наших партнеров Vogue&lt;/a&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;','','','','',''),
	(9,2,'Вы еще не посетили бутик Steiff? ','&lt;p style=&quot;margin-bottom: 6px;&quot;&gt;Вы еще не посетили бутик Steiff?&amp;nbsp;&lt;br&gt;Первый видео обзор.&lt;br&gt;Только высокое качество для ценителей!&lt;/p&gt;&lt;p style=&quot;margin-top: 6px; margin-bottom: 0px; display: inline;&quot;&gt;Бутик Steiff - ТРЦ Gulliver, 4 этаж.&lt;/p&gt;','&lt;p&gt;Вы еще не посетили бутик Steiff?&amp;nbsp;&lt;br&gt;Ваш первый видео обзор по ссылке:&amp;nbsp;&lt;a href=&quot;http://goo.gl/gNCWzc&quot; target=&quot;_blank&quot; rel=&quot;nofollow&quot; style=&quot;cursor: pointer;&quot;&gt;http://goo.gl/gNCWzc&lt;/a&gt;&lt;br&gt;Только высокое качество для ценителей!&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;iframe src=&quot;//www.youtube.com/embed/_90lT00IQtM&quot; width=&quot;640&quot; height=&quot;360&quot; frameborder=&quot;0&quot;&gt;&lt;/iframe&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot; font-weight: bold;&quot;&gt;Бутик Steiff - ТРЦ Gulliver, 4 этаж.&lt;/p&gt;','','Открытие Бутика Steiff в Киеве (ТРЦ Gulliver) | Little-House','','',''),
	(15,2,'Младший продавец-консультант','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;Приглашаем к сотрудничеству &quot;&lt;span style=&quot;font-weight: bold;&quot;&gt;Младший продавец-консультант в ЦУМ&lt;/span&gt;&quot;.&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Основные требования:&lt;/span&gt;&lt;/p&gt;&lt;ul style=&quot;padding: 0px 0px 0px 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;&quot;&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;опыт работы в ритейле от 1-го года - желателен&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;навыки успешных продаж и коммуникации с клиентами премиального уровня&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;личные качества: активная жизненная позиция, желание развиваться и достигать поставленных целей, грамотная речь, коммуникабельность, ответственность, инициативность, высокая исполнительность и обязательность.&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Основные обязанности:&lt;/span&gt;&lt;/p&gt;&lt;ul style=&quot;padding: 0px 0px 0px 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;&quot;&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;обеспечение высокого уровня обслуживания клиентов&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;осуществление активных продаж&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;обеспечение порядка в презентации продукции и торгового зала&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Условия работы:&lt;/span&gt;&lt;/p&gt;&lt;ul style=&quot;padding: 0px 0px 0px 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;&quot;&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;ЦУМ&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;оригинальная форменная одежда&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;заработная плата ставка + мотивационные бонусы&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;официальное трудоустройство и удобный график&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;возможность карьерного роста&lt;/li&gt;&lt;/ul&gt;','','Вакансии компании Little-House','','',''),
	(10,2,'21 июня немецкий бутик Steiff был открыт в ТРЦ Gulliver!','&lt;p&gt;21 июня немецкий бутик Steiff был открыт в ТРЦ Gulliver!&lt;br&gt;Ralf Anders Fahrig, Steiff в Европе, вручил эксклюзив на марку Steiff в Украине Светлане Тимоховой, Little House.&lt;br&gt;Steiff - это одежда для детей (от 0 до 6 лет), аксессуары, подарочные наборы и ЛЕГЕНДАРНЫЕ игрушки Steiff разных коллекций!&amp;nbsp;&lt;br&gt;Только высокое качество для ценителей!&lt;br&gt;Бутик Steiff - ТРЦ Gulliver, 4 этаж.&lt;br&gt;&lt;/p&gt;','&lt;p&gt;21 июня немецкий бутик Steiff был открыт в ТРЦ Gulliver!&lt;br&gt;Ralf Anders Fahrig, Steiff в Европе, вручил эксклюзив на марку Steiff в Украине Светлане Тимоховой, Little House.&lt;br&gt;Steiff - это одежда для детей (от 0 до 6 лет), аксессуары, подарочные наборы и ЛЕГЕНДАРНЫЕ игрушки Steiff разных коллекций!&amp;nbsp;&lt;br&gt;Только высокое качество для ценителей!&lt;br&gt;Бутик Steiff - ТРЦ Gulliver, 4 этаж.&lt;br&gt;&lt;/p&gt;','','','','',''),
	(11,2,'Бренд - менеджер','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;Приглашаем к сотрудничеству &lt;span style=&quot;font-weight: bold;&quot;&gt;Бренд - менеджера&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Требования:&lt;/span&gt;&lt;/p&gt;&lt;ul style=&quot;padding: 0px 0px 0px 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;&quot;&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Опыт работы на аналогичной должности от 5-ти лет;&lt;br&gt;&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Опыт выведения новых торговых марок на рынок;&lt;br&gt;&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Опыт работы в fashion retail будет преимуществом;&lt;br&gt;&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Знание английского языка - advanced (ведение переговоров, переписки).&lt;br&gt;&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Excel и Power Point - на профессиональном уровне.&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Проактивность, стрессоустойчивость, аналитическое мышление.&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Обязанности:&lt;/span&gt;&lt;/p&gt;&lt;ul style=&quot;padding: 0px 0px 0px 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;&quot;&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Разработка стратегий развития брендов;&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Вывод новых продуктов и торговых марок на рынок;&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Управление бюджетом по бренду, расчет ожидаемой прибыли и рентабельности с момента выведения бренда на рынок, определение возможности убытков для предприятия на первых этапах продвижения бренда и разработка предложений по их минимизации;&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Анализ конкурентов, трендов, новинок, рынка в целом;&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Управление ассортиментом товаров, участие в ценообразовании;&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Организация и проведение различных маркетинговых мероприятий (рекламных кампаний, презентаций);&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Работа с производителями и поставщиками;&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Работа с менеджерами (обучение, тренинги, консультации, презентации);&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Участие в партнерских программах и отраслевых выставках.&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Условия работы:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;Амбициозные задачи, профессиональный сhallenge, драйв&lt;/p&gt;','','Вакансии компании Little-House','','',''),
	(13,2,'Старший системный администратор','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Требования:&lt;/span&gt;&lt;/p&gt;&lt;ul style=&quot;padding: 0px 0px 0px 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;&quot;&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Высшее ит образование;&lt;br&gt;&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Опыт работы от 5 лет на аналогичной позиции;&lt;br&gt;&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Внимательность, ответственность, проактивность.&lt;br&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Задачи:&lt;/span&gt;&lt;/p&gt;&lt;ul style=&quot;padding: 0px 0px 0px 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;&quot;&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Установка и настройка серверных ОС Windows, ОС Unix, активное использование виртуализации&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Администрирование Windows домена AD, терминальных серверов, баз данных MS SQL&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Администрирование VLAN, маршрутизации и IP-телефонии на оборудовании CISCO&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Обеспечение информационной безопасности и защиты серверов и сетей&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Поддержка почтовой системы MS Exchange&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;Поддержка пользователей&lt;/li&gt;&lt;/ul&gt;','','Вакансии компании Little-House','','',''),
	(14,2,'Продавец-консультант','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&amp;nbsp;&lt;span style=&quot;font-weight: bold;&quot;&gt;Основные требования:&lt;/span&gt;&lt;/p&gt;&lt;ul style=&quot;padding: 0px 0px 0px 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;&quot;&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;опыт работы с премиальными марками одежды и/или обуви - от 1-го года&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;навыки успешных продаж и коммуникации с клиентами премиального уровня&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;личные качества: активная жизненная позиция, желание развиваться и достигать поставленных целей, грамотная речь, коммуникабельность, ответственность, инициативность, высокая исполнительность и обязательность.&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Основные обязанности:&lt;/span&gt;&lt;/p&gt;&lt;ul style=&quot;padding: 0px 0px 0px 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;&quot;&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;обеспечение высокого уровня обслуживания клиентов&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;осуществление активных продаж&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;обеспечение порядка в презентации продукции и торгового зала&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Условия работы:&lt;/span&gt;&lt;/p&gt;&lt;ul style=&quot;padding: 0px 0px 0px 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;&quot;&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;ЦУМ&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;&gt;оригинальная форменная одежда&lt;/li&gt;&lt;li style=&quot;line-height: 24px;&quot;