	(35,2,'Public Talk с Катериной Ореховой в бутике ROECKL','&lt;p&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;color: rgb(29, 33, 41); font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; text-align: center; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;&quot;&gt;6 апреля в бутике Roeckl прошла презентация весенне-летней коллекции LA BELLE REBELLE.&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;RU&quot;&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;','&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;color: rgb(29, 33, 41); font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; text-align: center; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;&quot;&gt;6 апреля в бутике Roeckl прошла презентация весенне-летней коллекции LA BELLE REBELLE. Новая инициатива - Public Talk с известным стилистом, главой студии Personal Shopper Екатериной Ореховой, была посвящена старту весенне-летнего сезона Roeckl в Украине. Гостей ожидала презентация новой коллекции бренда, стильные образы от Катерины Ореховой и мастер-класс по стилизации платков и шарфов.&lt;/span&gt;&lt;/span&gt;','','Презентация весенне-летней коллекции LA BELLE REBELLE','','',''),
	(25,2,'Roeckl','&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;ЦУМ Киев, 1 этаж&lt;/span&gt;&lt;/p&gt;&lt;p&gt;050 426 55 80&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;ТРЦ GULLIVER, 1 этаж&lt;/span&gt;&lt;/p&gt;&lt;p&gt;095 280 55 80&lt;/p&gt;','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','','','','',''),
