	(29,2,'Кошка choupette Карла Лагерфельда','&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Karl Lagerfeld &amp;amp; Steiff представили лимитированную версию игрушки choupette&lt;/span&gt;&lt;br&gt;&lt;/p&gt;','&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0px; color: rgb(34, 34, 34); font-size: 12.8px; line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 10.5pt; color: rgb(29, 33, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Плюшевая игрушка, вдохновленная ​​знаменитой кошкой Карла Лагерфельда,&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0px; color: rgb(34, 34, 34); font-size: 12.8px; line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 10.5pt; color: rgb(29, 33, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Choupette (Шупетт) будет представлена в бутике&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 10.5pt; color: rgb(29, 33, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot; lang=&quot;EN-US&quot;&gt;Steiff&lt;/span&gt;&lt;span style=&quot;font-size: 10.5pt; color: rgb(29, 33, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot; lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 10.5pt; color: rgb(29, 33, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;и ЦУМ Киев летом 2017года.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0px; color: rgb(34, 34, 34); font-size: 12.8px; line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 10.5pt; color: rgb(29, 33, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0px; color: rgb(34, 34, 34); font-size: 12.8px; line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 10.5pt; color: rgb(29, 33, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;«Steiff - идеальный выбор для такого сотрудничества.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0px; color: rgb(34, 34, 34); font-size: 12.8px; line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 10.5pt; color: rgb(29, 33, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Это - единственная компания, у которой есть необходимый опыт, чтобы выделить величественное и абсолютное изящество этой юной принцессы».&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0px; color: rgb(34, 34, 34); font-size: 12.8px; line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 10.5pt; color: rgb(29, 33, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Карл Лагерфельд&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0px; color: rgb(34, 34, 34); font-size: 12.8px; line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 10.5pt; color: rgb(29, 33, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0px; color: rgb(34, 34, 34); font-size: 12.8px; line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 10.5pt; color: rgb(29, 33, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;У нее более 43 000 поклонников Facebook. За ней следуют 96 000 человек в Instagram. Она позирует для ряда самых эксклюзивных брендов мира, она появлялась на страницах ведущих fashion и life-style журналов.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0px; color: rgb(34, 34, 34); font-size: 12.8px; line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 10.5pt; color: rgb(29, 33, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Но ее нельзя назвать просто еще одной актрисой, музыкантом или спортсменом. Она, вполне возможно, - самая избалованная любимица в мире!&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0px; color: rgb(34, 34, 34); font-size: 12.8px; line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 10.5pt; color: rgb(29, 33, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Мы говорим о Choupette, кошке, которая украла сердце иконы мира моды Карла Лагерфельда. Choupette - излюбленная муза художника и его непременный компаньон.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0px; color: rgb(34, 34, 34); font-size: 12.8px; line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0px; color: rgb(34, 34, 34); font-size: 12.8px; line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 10.5pt; color: rgb(29, 33, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Лимитированная версия плюшевой игрушки Choupette от KARL LAGERFELD и Steiff имитирует реальное животное семейства кошачьих: пушистый белый мех, большие голубые глаза и даже завораживающая мышка-компаньон.&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0px; color: rgb(34, 34, 34); font-size: 12.8px; line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 10.5pt; color: rgb(29, 33, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Choupette изготовлена из мягкого плюша белого цвета, с позолоченной кнопкой в ухе и поставляется в подарочной упаковке с магнитной мышью из черной искусственной кожи (6 см).&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0px; color: rgb(34, 34, 34); font-size: 12.8px; text-align: justify; line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 10.5pt; line-height: 21px; color: rgb(29, 33, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Во всем мире выпущено всего 2 000 штук, которые будут доступны в бутиках KARL LAGERFELD, в магазинах Steiff, а также в избранных торговых точках.&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0px; color: rgb(34, 34, 34); font-size: 12.8px; text-align: justify; line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 10.5pt; line-height: 21px; color: rgb(29, 33, 41); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Choupette будет эксклюзивно представлена в Украине в официальных бутиках бренда лимитированным тиражом этим летом.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0px; color: rgb(34, 34, 34); fo