	(19,2,'Пресс-ланч FALKE: особенности бренда','&lt;p&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span id=&quot;docs-internal-guid-8f0b51be-dd6d-222f-ea3d-62c84f0669c3&quot;&gt;&lt;span style=&quot;vertical-align: baseline;&quot;&gt;В конце ноября компания Little House и знаковый немецкий бренд FALKE провели пресс-ланч, посвященный бренду, его уникальным особенностям&lt;/span&gt;&lt;/span&gt;, отличительным характеристикам и перспективам развития на украинском рынке.&lt;br&gt;&lt;/span&gt;&lt;/p&gt;','&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;В конце ноября компания Little House и знаковый немецкий бренд FALKE провели пресс-ланч, посвященный бренду, его уникальным особенностям, отличительным характеристикам и перспективам развития на украинском рынке. Ведь качественная продукция Falke уже доступна украинцам, и представлена она в официальных монобрендовых бутиках Falke на 1-м и Falke Kids на 4- м этаже ТРЦ Gulliver, а также в корнерах на -1, 3 &amp;nbsp;и 5 этажах только открывшегося Главного Универмага страны ЦУМ Киев. В атмосфере легкого банкета гости могли насладится приятной атмосферой общения в кругу партнеров - представителей ключевых медиа ресурсов, глянцевых и деловых украинских изданий и ведущих диджитал площадок Украины.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Главной темой разговора были конечно же особенности бренда и его продукции, а немецкое качество и технологии Falke позволяют говорить о безусловном авторитете бренда, как мануфактурного предприятия со 120-летней историей, с годами исследований, разработок и педантичной ручной работы за плечами. Как результат – бескомпромиссное качество в каждой детали, высокая функциональность и долговечность изделий Falke. Впечатляющий мировой спрос на немецкую продукцию Falke берет начало с философии бренда «качество во имя качества» и подтвержден комфортом в носке изделий Falke. &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Представитель бренда в Германии, региональный менеджер по продажам Falke Светлана Лабуда поделилась секретами мастерства и перенесла гостей на мануфактуру Falke, где фанатично день за днем уже более 100 лет трудятся сотрудники компании, чтобы достичь этого совершенства в качестве, дизайне и комфорте. Многие процессы в производстве носка, гольфа или чулка Falke до сих пор выполняются вручную!&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Учредитель компании Little House, представившей бренд Falke Украине, Светлана Тимохова, считает главной миссией компании - вывод на рынок авторитетных брендов Европы класса премиум-де люкс и развитие высокой культуры европейского шопинга в Украине.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span id=&quot;docs-internal-guid-525ee625-dd6d-5268-5905-463301728e0d&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Гостям были представлены актуальные коллекции Falke AW 2016-17 «Primitus-Evolutio», а также приоткрыта завеса ближайшей весенне-летней коллекции бренда Burlington, который является частью компании Falke с 2008года. Знаменитые трендовые носки с ромбами, геометрическими узорами и иллюзорными рисунками – для всех, кто умеет комбинировать несовместимое, для смелых, стильных и модных украинцев.&lt;/span&gt;&lt;/p&gt;','','Новости Falke | Little-House','','',''),
	(33,2,'Продавец - консультант Falke ТРЦ Ocean Plaza','&lt;p&gt;&lt;br&gt;&lt;/p&gt;','&lt;p style=&quot;margin-bottom: 0px; padding: 0px; line-height: 20px; color: rgb(51, 51, 51); font-family: &amp;quot;Graphik Regular&amp;quot;, sans-serif; font-size: 16px;&quot;&gt;&lt;span style=&quot;color: black; font-family: Arial, sans-serif; font-size: 12pt;&quot;&gt;Приглашаем принять участие в конкурсе на позицию\r\n&quot;Продавец - консультант&quot;&lt;/span&gt;&amp;nbsp;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px; line-height: 20px; color: rgb(51, 51, 51); font-family: &amp;quot;Graphik Regular&amp;quot;, sans-serif; font-size: 16px;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px; line-height: 20px; color: rgb(51, 51, 51); font-family: &amp;quot;Graphik Regular&amp;quot;, sans-serif; font-size: 16px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Основные требования:&lt;/span&gt;&lt;/p&gt;&lt;ul style=&quot;padding: 0px 0px 0px 15px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Graphik Regular&amp;quot;, sans-serif; font-size: 16px;&quot;&gt;&lt;li style=&quot;line-height: 24px; margin: 0px; padding: 0px; list-style-position: outside;&quot;&gt;опыт работы в luxury\\премиум рознице не менее 3 - ех лет;&lt;/li&gt;&lt;li style=&quot;line-height: 24px; margin: 0px; padding: 0px; list-style-position: outside;&quot;&gt;опыт работы с премиальными марками нижнего белья, одежды, аксессуаров - преимущество;&lt;/li&gt;&lt;li style=&quot;line-height: 24px; margin: 0px; padding: 0px; list-style-position: outside;&quot;&gt;навыки успешных продаж и коммуникации с клиентами премиального уровня;&lt;/li&gt;&lt;li style=&quot;line-height: 24px; margin: 0px; padding: 0px; list-style-position: outside;&quot;&gt;личные качества: активная жизненная позиция, желание развиваться и достигать поставленные цели, грамотная речь, коммуникабельность, ответственность, инициативность, высокая исполнительность и обязательность.&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px; line-height: 20px; color: rgb(51, 51, 51); font-family: &amp;quot;Graphik Regular&amp;quot;, sans-serif; font-size: 16px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px; line-height: 20px; color: rgb(51, 51, 51); font-family: &amp;quot;Graphik Regular&amp;quot;, sans-serif; font-size: 16px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Основные обязанности:&lt;/span&gt;&lt;/p&gt;&lt;ul style=&quot;padding: 0px 0px 0px 15px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Graphik Regular&amp;quot;, sans-serif; font-size: 16px;&quot;&gt;&lt;li style=&quot;line-height: 24px; margin: 0px; padding: 0px; list-style-position: outside;&quot;&gt;осуществление активных продаж;&lt;/li&gt;&lt;li style=&quot;line-height: 24px; margin: 0px; padding: 0px; list-style-position: outside;&quot;&gt;обеспечение высокого уровня обслуживания клиентов;&lt;/li&gt;&lt;li style=&quot;line-height: 24px; margin: 0px; padding: 0px; list-style-position: outside;&quot;&gt;знание кассовой дисциплины и программы 1С - обязательное требование.&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px; line-height: 20px; color: rgb(51, 51, 51); font-family: &amp;quot;Graphik Regular&amp;quot;, sans-serif; font-size: 16px;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px; line-height: 20px; color: rgb(51, 51, 51); font-family: &amp;quot;Graphik Regular&amp;quot;, sans-serif; font-size: 16px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Условия работы:&lt;/span&gt;&lt;/p&gt;&lt;ul style=&quot;padding: 0px 0px 0px 15px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Graphik Regular&amp;quot;, sans-serif; font-size: 16px;&quot;&gt;&lt;li style=&quot;line-height: 24px; margin: 0px; padding: 0px; list-style-position: outside;&quot;&gt;ТЦ &amp;nbsp;Ocean Plaza ( 2\\2 c 9.30 до 22.00);&lt;/li&gt;&lt;li style=&quot;line-height: 24px; margin: 0px; padding: 0px; list-style-position: outside;&quot;&gt;оригинальная форменная одежда;&lt;/li&gt;&lt;li style=&quot;line-height: 24px; margin: 0px; padding: 0px; list-style-position: outside;&quot;&gt;ставка + % от продаж;&lt;/li&gt;&lt;li style=&quot;line-height: 24px; margin: 0px; padding: 0px; list-style-position: outside;&quot;&gt;официальное трудоустройство;&lt;/li&gt;&lt;li style=&quot;line-height: 24px; margin: 0px; padding: 0px; list-style-position: outside;&quot;&gt;возможность карьерного роста.&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px; line-height: 20px; color: rgb(51, 51, 51); font-family: &amp;quot;Graphik Regular&amp;quot;, sans-serif; font-size: 16px;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px; line-height: 20px; color: rgb(51, 51, 51); font-family: &amp;quot;Graphik Regular&amp;quot;, sans-serif; font-size: 16px;&quot;&gt;&lt;br&gt;&lt;/p&gt;','','','','',''),
