:99;\r\n	mso-style-parent:&quot;&quot;;\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:&quot;Times New Roman&quot;,serif;}\r\n&lt;/style&gt;\r\n&lt;![endif]--&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 11pt;&quot;&gt;Год\r\nназад известный во всем мире бренд из Германии S&lt;/span&gt;&lt;span style=&quot;font-size: 11pt;&quot; lang=&quot;EN-US&quot;&gt;teiff&lt;/span&gt;&lt;span style=&quot;font-size: 11pt;&quot;&gt;\r\nоткрыл свои двери в Киеве и 2 июня 2017 года отметил свою первую годовщину.\r\nПоздравить именинника в ТРЦ Gulliver пришли друзья и партнеры: главные\r\nредактора журналов Соня Забуга, Константин Путиленко, Ирина Заря - соучредитель\r\nи управляющий партнер сети кинотеатров &quot;Оскар&quot;, Наталия Тулинова,\r\nзаместитель генерального директора по развитию, маркетингу в ISIDA clinic,\r\nТатьяна Римиханова, Антон Яременко и другие гости. Во время мероприятия гости\r\nвеселились под музыкальный сет от dj Dima Freeman, пробовали сладости в Steiff\r\nCandy Bar и торт в стилистике культового плюшевого мишки. Главным сюрпризом\r\nпраздника стал розыгрыш 10 знаковых плюшевых мишек, которые пополнили коллекции\r\nгостей.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n','','STEIFF Anniversary Party','','',''),
