n	font-family:&quot;Times New Roman&quot;,serif;}\r\n&lt;/style&gt;\r\n&lt;![endif]--&gt;\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 11pt;&quot;&gt;В\r\nкомпания Little House уверены, что &amp;nbsp;помогать это просто и доступно\r\nабсолютно каждому.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;\r\n\r\n&lt;/span&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 11pt;&quot;&gt;В\r\nпреддверии Дня Защиты Детей подопечным Фонда Таблеточки презентованы подарки\r\nдетям, которые находятся на лечении и в паллиативной программе. Мы знаем точно,\r\nчто каждому ребенку важно не только внимание и наша помощь, но и комфорт,\r\nкоторый, как мы надеемся, им обеспечит комфортная одежда и аксессуары от\r\nнемецкого бренда &lt;/span&gt;&lt;span style=&quot;font-size: 11pt;&quot; lang=&quot;EN-US&quot;&gt;Steiff&lt;/span&gt;&lt;span style=&quot;font-size: 11pt;&quot;&gt;.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;\r\n\r\n&lt;span style=&quot;font-size: 11pt;&quot;&gt;Желаем всем еще больше добрых дел и горящих глаз&lt;/span&gt;&lt;/span&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 11pt;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 11pt;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 11pt;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','','Little House и Международный Благотворительный Фонд Таблеточки','','','');
INSERT INTO `oc_newsblog_article_description` (`article_id`, `language_id`, `name`, `preview`, `description`, `tag`, `meta_title`, `meta_h1`, `meta_description`, `meta_keyword`)
VALUES
	(36,2,'Roeckl Summer Lifestyle','&lt;p&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;color: rgb(29, 33, 41); font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; text-align: center; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;&quot;&gt;ROECKL представляет ключевые модели платков и сумок летнего сезона в новой fashion съемке Summer Lifestyle.&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;RU&quot;&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;','&lt;p&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;color: rgb(29, 33, 41); font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; text-align: center; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;&quot;&gt;ROECKL представляет ключевые модели платков и сумок летнего сезона в новой fashion съемке Summer Lifestyle. Смотрите, как беззаботно и легко можно носить платки, шляпы, сумки бренда и превращайте их в эффектную часть летнего гардероба. Коллекция бренда представлена в ТРЦ Gulliver и ЦУМ Київ / TSUM Kyiv Department Store. Модель Inna Bee Фотограф Юрий Белах (Yurko Belakh) Production The New Black Production Отдельная благодарность ТРЦ Gulliver за предоставление локации для съемки.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;color: rgb(29, 33, 41); font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: