idow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:&quot;Times New Roman&quot;,serif;}\r\n&lt;/style&gt;\r\n&lt;![endif]--&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;В субботу 27 мая совместно с Литературным клубом Букмоль в\r\nмагазине S&lt;span style=&quot;mso-ansi-language:EN-US&quot; lang=&quot;EN-US&quot;&gt;steiff &lt;/span&gt;в ТРЦ\r\nGulliver прошло чтение книги-картинки шведский писательницы и художницы Мии\r\nНильсон «Х’юґо – лихий, кровожерний і страшенно небезпечний?». После маленькие\r\nгости приняли участие в мастер-классе по мотивам книги, где каждый смог\r\nнаучиться создавать своего крокодильчика. &lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n','','Литературные чтения в STEIFF','','',''),
	(37,2,'Little House - партнер на Всеукраинской премии &quot;Женщина III Тысячелетия&quot;','&lt;p&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 11pt;&quot;&gt;Little House - партнер\r\nна церемонии награждения Всеукраинской премии &quot;Женщина III\r\nТысячелетия&quot;.&lt;/span&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;','&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;18 ноября 2017 года в Киевском Национальном Академическом\r\nТеатре Оперетты состоялась &lt;span lang=&quot;EN-US&quot;&gt;X&lt;/span&gt;\r\nюбилейная церемония награждения Всеукраинской премией &quot;Женщина ІІІ\r\nтысячелетия&quot;.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Всеукраинская премия &quot;Женщина ІІІ тысячелетия&quot; -\r\nэто единственная в своём роде украинская награда, которая отмечает выдающиеся\r\nзаслуги женщин. Даже в самые сложные времена женщины заботятся о детях, мужьях\r\nи родителях, обустраивают быт, вникают в проблемы детских домов и больниц,\r\nсоздают красоту, завораживают своим пением, актёрским талантом.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Эта премия основана для того, чтобы напомнить очевидное: мир\r\nбез женщины невозможен! И неслучайно, что Высший представительский совет,\r\nежегодно определяющий победительниц премии, традиционно состоит только из\r\nмужчин. Ведь кто ещё по достоинству может оценить заслуги женщин.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Компания Little House выступила партнером церемонии,\r\nпредставив корнера эксклюзивных аксессуаров. Гости смогли ближе познакомиться с\r\nпродукцией одного из ключевых брендов &lt;span lang=&quot;EN-US&quot;&gt;Roeckl&lt;/span&gt;, поучаствовать в мастер классе по стилизации платков и\r\nшалей и получили подарочные сертификаты разного номинала для покупок в\r\nмагазинах компании.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Регламент использования подарочных сертификатов:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;500 гривен&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Действителен при покупке на сумму от 2 000 грн. во всех\r\nмагазинах сети в &amp;nbsp;ТРЦ GULLIVER, &lt;span lang=&quot;EN-US&quot;&gt;Ocean Plaza&lt;/span&gt;, &lt;span lang=&quot;EN-US&quot;&gt;Sky\r\nMall&lt;/span&gt;, &lt;span lang=&quot;EN-US&quot;&gt;Art Mall&lt;/span&gt;.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Действует на весь ассортимент, в том числе товар со\r\nскидками. Действителен до 15 декабря 2017 г.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Не подлежит обмену на денежный эквивалент и может быть использован\r\nтолько 1 раз, не суммируются между собой. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;1000 гривен&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Действителен во всех магазинах сети в &amp;nbsp;ТРЦ GULLIVER, &lt;span lang=&quot;EN-US&quot;&gt;Ocean Plaza&lt;/span&gt;, &lt;span lang=&quot;EN-US&quot;&gt;Sky Mall&lt;/span&gt;, &lt;span lang=&quot;EN-US&quot;&gt;Art Mall&lt;/span&gt;.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Действует на весь ассортимент, в том числе товар со\r\nскидками. Действителен до 15 декабря 2017 г.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Не подлежит обмену на денежный эквивалент и может быть\r\nиспользован только 1 раз, не суммируются между собой. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Если сумма покупки по сертификаты ниже его номинала, разница\r\nне компенсируется, при сумме покупки больше номинала – разница доплачивается.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;','','Little House - партнер на Всеукраинской премии &quot;Женщина III Тысячелетия&quot;','','',''),
