me=&quot;List Table 5 Dark Accent 5&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;51&quot;\r\n   Name=&quot;List Table 6 Colorful Accent 5&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;52&quot;\r\n   Name=&quot;List Table 7 Colorful Accent 5&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;46&quot;\r\n   Name=&quot;List Table 1 Light Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;47&quot; Name=&quot;List Table 2 Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;48&quot; Name=&quot;List Table 3 Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;49&quot; Name=&quot;List Table 4 Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;50&quot; Name=&quot;List Table 5 Dark Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;51&quot;\r\n   Name=&quot;List Table 6 Colorful Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;52&quot;\r\n   Name=&quot;List Table 7 Colorful Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\n   Name=&quot;Mention&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\n   Name=&quot;Smart Hyperlink&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\n   Name=&quot;Hashtag&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\n   Name=&quot;Unresolved Mention&quot;/&gt;\r\n &lt;/w:LatentStyles&gt;\r\n&lt;/xml&gt;&lt;![endif]--&gt;&lt;!--[if gte mso 10]&gt;\r\n&lt;style&gt;\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:&quot;Обычная таблица&quot;;\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:&quot;&quot;;\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:&quot;Times New Roman&quot;,serif;}\r\n&lt;/style&gt;\r\n&lt;![endif]--&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;2&amp;nbsp;814 243 гривны - столько денежных средств было\r\nсобрано фондом Let\'s help на благотворительном мероприятии &quot;White\r\nBox&quot;, организованном в рамках реализации программы &quot;Достойная\r\nстарость&quot;. Благотворительное мероприятие &quot;White Box&quot; - это уже\r\nвторое мероприятие, которое проводит фонд в 2017 году на поддержку программы\r\n«Достойная старость». На этот раз фонд собирал средства на приобретение новых\r\nкроватей, матрасов, одеял, подушек, постельного белья и полотенец для 1 500\r\nподопечных в 38 домах престарелых.&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;Гостей, которые приобрели билеты, ожидал торжественный\r\nгала-ужин с изысканными блюдами, приготовленными знаменитым шеф-поваром\r\nспециально для этого благотворительного ужина, благотворительный аукцион с\r\nнеобычными лотами и выступления украинских звезд.&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;На аукционе были проданы следующие лоты: боксерские перчатки\r\nот Владимира Кличка с его личным автографом, фотография и личный автограф\r\nлегендарного французского актера Марселя Марсо, уникальная мягкая игрушка\r\n«Рождественский мишка» из лимитированной коллекции от «Steiff», скульптура\r\n«Пирамида» из личной коллекции Натальи Заболотной, ювелирное украшение от\r\nювелирной компании «Оберег», уникальная картина известного художника И.\r\nГубского «Портной, который шьет» из личной коллекции семьи Бондаренко,\r\nантикварная фарфоровая ваза 19 века из личной коллекции Яны Столар, вышиванка\r\nукраинского дизайнера Юлии Магдич в которой выступала Патрисия Каас, подарочный\r\nсертификат на уик-энд для двоих в Амстердам от туристической компании «Yana\r\nLuxury Travel», колье от ювелирного бренда «Guzema Jewelry», ужин от известного\r\nшеф-повара Артема Лоскутова, шелкография одного из самых известных художников\r\nсовременности Ильи Чичкана.&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;Также, на аукционе было продано 15 уникальных картин\r\nукраинской художницы Анастасии Грицингер, на которых были изображены мировые\r\nзвезды и политические деятели в почтенном возрасте, которые умерли молодыми.&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;Заметим, что все лоты были предоставлены фонду для аукциона\r\nбесплатно К организации этого мероприятия присоединилось много людей, которых\r\nобъединила идея программы «Гідна старість».&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;mso-fareast-language:\r\nRU&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;mso-fareast-language:\r\nRU&quot;&gt; &lt;/span&gt;&lt;/p&gt;\r\n\r\n','','STEIFF на благотворительном аукционе White Box','','','');
