on:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:&quot;Times New Roman&quot;,serif;}\r\n&lt;/style&gt;\r\n&lt;![endif]--&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;13 июля состоялось открытие первого в Украине монобрендового\r\nбутика нижнего белья HANRO OF SWITZERLAND. В этот вечер гости узнали секреты\r\nпроизводства мужской и женской коллекций бренда, окунулись в атмосферу\r\nсдержанной роскоши и познакомились с коллекцией сезона осень-зима 2017/18 Time\r\nis Luxury. Новый монобрендовый магазин объединяет и женскую, и мужскую\r\nколлекции в одном пространстве, предоставляет то уникальное качество и\r\nнесравнимые ни с чем ощущения комфорта в каждом изделии. Продукцию HANRO\r\nотличает первоклассное качество, дорогостоящая ручная работа и продуманность\r\nдеталей. Многолетние традиции в сочетании с техническими новшествами и\r\nактуальным дизайном делают HANRO неповторимым брендом, который более 130 лет\r\nпроизводит элитное нижнее белье, одежду для сна, йоги и lounge-одежду. Hanro\r\nпредставлен почти в 50 странах и теперь доступен и украинцам.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n','','HANRO Opening','','',''),
