ily:&quot;Times New Roman&quot;,serif;}\r\n&lt;/style&gt;\r\n&lt;![endif]--&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Совместно с журналом Chercher la femme компания Little House\r\nна 5 этаже ЦУМ Київ провели настоящий детский праздник, на котором было все для\r\nпрекрасного настроения. Детей ждала сказочная механическая экспозиция\r\n&quot;Домик в лесу&quot;, с движущимися животными, которая приехала в Киев из\r\nМюнхена со штаб квартиры&amp;nbsp; Steiff и является частью ожившей медвежьей\r\nсказки, где каждая игрушка занята своим делом. Дети попробовали себя в роли\r\nнастоящих дизайнеров, посетив мастер-класс по созданию рисунков для ткани от\r\nхудожника и скульптора Astian Rey. А мам ждала презентация новых коллекций\r\nодежды и игрушек Steiff, белья и пижам Sanetta, идеальных платьев ELSY и\r\nфункциональных аксессуаров Falke Kids. Все окунулись в праздничную атмосферу со\r\nвкусными угощениями, лимонадами, шампанским и фотосессиями у знаменитого домика\r\nSteiff. Спасибо всем гостям и участникам, мы с нетерпением будем ждать новых\r\nвстреч.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n','','Детский праздник в корнере Little House в ЦУМ Киев','','',''),
