	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:&quot;Times New Roman&quot;,serif;}\r\n&lt;/style&gt;\r\n&lt;![endif]--&gt;\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Компания Little House выступила партнером церемонии,\r\nпредставив корнер эксклюзивных аксессуаров Roeckl.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 11pt;&quot;&gt;Среди лауреаток премии «Женщина III Тысячелетия»\r\nСветлана Тимохова - генеральный директор компании&lt;/span&gt;&lt;span style=&quot;font-size: 11pt;&quot; lang=&quot;EN-US&quot;&gt;Little House&lt;/span&gt;&lt;span style=&quot;font-size: 11pt;&quot;&gt; и посол бренда Roeckl в Украине. Всех номинантов премии поздравил также\r\nглава государства, а после официальной части церемонию награждения продолжил\r\nконцерт и подарки от бренда.&lt;/span&gt;&lt;/span&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 11pt;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 11pt;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;span style=&quot;font-size: 11pt;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;','','ROECKL на церемонии награждения премии &quot;Женщина ІІI Тысячелетия&quot;','','','');
