Locked=&quot;false&quot; Priority=&quot;50&quot; Name=&quot;List Table 5 Dark Accent 5&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;51&quot;\r\n   Name=&quot;List Table 6 Colorful Accent 5&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;52&quot;\r\n   Name=&quot;List Table 7 Colorful Accent 5&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;46&quot;\r\n   Name=&quot;List Table 1 Light Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;47&quot; Name=&quot;List Table 2 Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;48&quot; Name=&quot;List Table 3 Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;49&quot; Name=&quot;List Table 4 Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;50&quot; Name=&quot;List Table 5 Dark Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;51&quot;\r\n   Name=&quot;List Table 6 Colorful Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;52&quot;\r\n   Name=&quot;List Table 7 Colorful Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\n   Name=&quot;Mention&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\n   Name=&quot;Smart Hyperlink&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\n   Name=&quot;Hashtag&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\n   Name=&quot;Unresolved Mention&quot;/&gt;\r\n &lt;/w:LatentStyles&gt;\r\n&lt;/xml&gt;&lt;![endif]--&gt;&lt;!--[if gte mso 10]&gt;\r\n&lt;style&gt;\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:&quot;Обычная таблица&quot;;\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:&quot;&quot;;\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:&quot;Times New Roman&quot;,serif;}\r\n&lt;/style&gt;\r\n&lt;![endif]--&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;29 ноября 2017 года в монобрендовом магазине Steiff в ТРЦ\r\nGulliver прошла презентация новой сезонной коллекции плюшевых игрушек и\r\nколлекционных изделий бренда. Первые лица Steiff Ian Munro - директор по\r\nмеждународным продажам (Steiff, Германия) и Ralf Anders Fahrig - региональный менеджер\r\nпо продажам в Европе и Африке (Steiff, Германия) посетили Киев специально для\r\nпрезентации и открыли гостям секреты успешности компании, а также лично\r\nпредставили новую коллекцию - Soft Cuddly Friends и коллекционные экземпляры\r\nбренда.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Познакомиться первыми с новинками Steiff пришли друзья,\r\nпартнеры и клиенты бренда: главный редактор ELLE Ukraine Соня Забуга,\r\nоснователь бренда ZARINA – Наталья Нетовкина, куратор ресторанов «Mr. Zuma» и\r\n«Mercato Italiano» Анастасия Семенова, Елена Ивченко, Татьяна Римиханова, Таня\r\nФокина и другие. Многие были уже знакомы с коллаборациями бренда. В одно время,\r\nэто была японская компания Medicom Toys, в этом году - KARL LAGERFELD, а на\r\nмероприятии Ian Munro упомянул о будущем важном сотрудничестве бренда с\r\nкомпанией Disney. Гости узнали и о секретах мастерства Steiff, которое\r\nсовершенствуется вот уже более 135 лет, и о самых важных требованиях к каждому\r\nизделию, и окунулись в атмосферу приближающихся новогодних праздников.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n','','Steiff Cocktail day','','','');
