;\r\n	font-family:&quot;Times New Roman&quot;,serif;}\r\n&lt;/style&gt;\r\n&lt;![endif]--&gt;\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Уже второй год подряд в преддверии новогодних праздников\r\nпроходит Red Shoes Christmas Dance, танцевальный вечер L\'Officiel Украина. Бал\r\nоткрывали пары-амбассадоры журнала: на паркет вышли Христя Храновская, Артем\r\nКлимчук, Катя Сильченко, Иван Фролов, Иванна Никонова, Александра Олейник,\r\nМаксим Некрасов, Полина Неня, Ася Мхитарян, Никита Середа, Алексей и Мария\r\nДидковские, Диана Ставницер,&amp;nbsp; Анастасия и Александр Пилипишины, Людмила\r\nБовкун и Тамила Немченко. Гости угощались коктейлями Martini, танцевали под\r\nкаверы на знаменитые рождественские композиции и хвастались друг перед другом\r\nалыми туфельками - ведь дресс-кодом вечера выступила именно красная обувь. По\r\nзавершению курса бального танца пары получили подарки от бренда Falke. Задачей\r\nорганизаторов было создать атмфосферу новогоднего торжества и напомнить гостям\r\nо грядущих зимних праздниках - и, думаем, нам это удалось!&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;','','L\'Officiel Red Shoes Christmas Dance','','',''),
