\n&lt;/style&gt;\r\n&lt;![endif]--&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;27 и 28 октября в Колонном зале столичной мэрии прошел\r\nлегендарный Венский бал, причем он проходил в двух форматах: классический\r\nвзрослый бал и детский. Международным культурным событием в столице Украины\r\nзанимались мэры Вены и Киева, Украинско-австрийская ассоциация, Национальная\r\nкомиссия по делам ЮНЕСКО, диаспора из США. Изысканную атмосферу мероприятия\r\nсоздавали музыкальные шедевры Вольфганга Амадея Моцарта, Йозефа Гайдна, Иоганна\r\nШтрауса в исполнении неоднократного музыкального организатора многих венских\r\nбалов, симфонического оркестра «Киев-Классик». Стремясь подчеркнуть\r\nуникальность события, дирижер и музыкант, народный артист Украины, профессор,\r\nпосол украинской культуры, артист ЮНЕСКО во имя мира Герман Макаренко\r\nспециально для бала создал авторскую интерпретацию мелодии Штрауса, которая\r\nдействительно впечатлила гостей. Впервые в Киеве исполнили дуэтом арию из оперы\r\nДжузеппе Верди «Травиатта» украинская оперная дива Сусанна Чахоян и знаменитый\r\nавстрийский тенор Себастьян Рейнтхаллер.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Во время балла были выбраны принцессы и королевы среди\r\nтанцевальных пар участников, которые получили подарки от немецкого бренда &lt;span style=&quot;mso-ansi-language:EN-US&quot; lang=&quot;EN-US&quot;&gt;Steiff&lt;/span&gt;.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n','','STEIFF – партнер Благотворительного Венского бала','','',''),
