uot;50&quot; Name=&quot;List Table 5 Dark Accent 5&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;51&quot;\r\n   Name=&quot;List Table 6 Colorful Accent 5&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;52&quot;\r\n   Name=&quot;List Table 7 Colorful Accent 5&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;46&quot;\r\n   Name=&quot;List Table 1 Light Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;47&quot; Name=&quot;List Table 2 Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;48&quot; Name=&quot;List Table 3 Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;49&quot; Name=&quot;List Table 4 Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;50&quot; Name=&quot;List Table 5 Dark Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;51&quot;\r\n   Name=&quot;List Table 6 Colorful Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;52&quot;\r\n   Name=&quot;List Table 7 Colorful Accent 6&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\n   Name=&quot;Mention&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\n   Name=&quot;Smart Hyperlink&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\n   Name=&quot;Hashtag&quot;/&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; SemiHidden=&quot;true&quot; UnhideWhenUsed=&quot;true&quot;\r\n   Name=&quot;Unresolved Mention&quot;/&gt;\r\n &lt;/w:LatentStyles&gt;\r\n&lt;/xml&gt;&lt;![endif]--&gt;&lt;!--[if gte mso 10]&gt;\r\n&lt;style&gt;\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:&quot;Обычная таблица&quot;;\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:&quot;&quot;;\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:&quot;Times New Roman&quot;,serif;}\r\n&lt;/style&gt;\r\n&lt;![endif]--&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;25 ноября в киевском ресторане Canadian Club состоялся\r\nдолгожданный конкурс «Игры талантливых». В ивенте приняли участие дети от 4 до\r\n12 лет. В состав конкурсных дисциплин вошли моделинг, вокал, танцы,\r\nизобразительное искусство, а также творческие номера в свободных авторских\r\nжанрах. Это первый в истории журнала «Публичные люди» проект, созданный\r\nспециально для детей. Ведущими программы стали артистка, вокалистка, участница\r\n«Голоса страны» и «Х-фактора» Анна Фирагина и участник телепроектов «Мастер\r\nШеф. Дети» и «Рассмеши комика. Дети» Ваня Тамашев. Членами жюри «Игр» стали\r\nнародная артистка Украины Наталия Бучинская, главный редактор журнала\r\n«Публичные люди» Елена Ходос, директор Фонда поддержки молодежного и\r\nолимпийского плавания Инна Силантьева, королева Венского Бала Лана Тиграна и\r\nоснователь глянцевого журнала Fashion Today Эльфира Иоффе. Это первый в истории\r\nжурнала «Публичные люди» проект, созданный специально для детей. Ведущими\r\nпрограммы стали артистка, вокалистка, участница «Голоса страны» и «Х-фактора»\r\nАнна Фирагина и участник телепроектов «Мастер Шеф. Дети» и «Рассмеши комика.\r\nДети» Ваня Тамашев. Все участники модельного показа получили подарки от сети\r\nмультибрендовых магазинов детской одежды LITTLE HOUSE.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.4;&quot;&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n','','LITTLE HOUSE - партнер проекта «Игры талантливых»','','','');
